(1447, 370, 'specification_group_info', 'a:2:{i:0;a:5:{s:19:\"specification_title\";s:30:\"Suzuki GD110 Price in Pakistan\";s:22:\"specification_subtitle\";s:40:\"60 km/per Ltr on Long Route Fuel Average\";s:19:\"specification_price\";s:7:\"119,000\";s:22:\"specification_image_id\";i:375;s:19:\"specification_image\";s:67:\"http://bike.qeemat.com/wp-content/uploads/2018/04/suzuki-gd-110.jpg\";}i:1;a:5:{s:19:\"specification_title\";s:31:\"Suzuki GD110s Price in Pakistan\";s:22:\"specification_subtitle\";s:25:\"110cc Engine Displacement\";s:19:\"specification_price\";s:7:\"136,000\";s:22:\"specification_image_id\";i:375;s:19:\"specification_image\";s:67:\"http://bike.qeemat.com/wp-content/uploads/2018/04/suzuki-gd-110.jpg\";}}'),
(1448, 370, 'tab_group_info', 'a:2:{i:0;a:2:{s:9:\"tab_title\";s:6:\"Review\";s:8:\"tab_desc\";s:0:\"\";}i:1;a:2:{s:9:\"tab_title\";s:8:\"Features\";s:8:\"tab_desc\";s:1385:\"<ul class=\"features\">\r\n	<li><span>Engine</span> 110cc  Displacement</li>\r\n<li><span>Fuel Average</span> 60 km/per Ltr on Long Route </li>\r\n								\r\n									<li><span>Transmission</span> 4-Speed </li>\r\n									<li><span>Fuel Tank</span> 9.0 Liter  Capacity</li>\r\n									<li><span>Top Speed</span> 105 km/per Hour </li>\r\n									<li><span>Other</span> Available in 4 Colors: Red, Black, Blue and Gray</li>\r\n									\r\n									<li><span></span> 4-Stroke, 110 cc, SOHC, Air-Cooled Powerful Engine</li>\r\n									\r\n									<li><span></span> Decompressor Kick Start System</li>\r\n									<li><span></span> CDI Ignition System</li>\r\n									<li><span></span> Front Suspension: Telescopic, Coil Spring Oil Damped</li>\r\n									<li><span></span> Rear Suspension: Swingarm Type, Coil Spring, Oil Damped, Spring Pre-Load 5-Way Adjustable</li>\r\n									<li><span></span> BS Type Carburetor Fuel System</li>\r\n									<li><span></span> Attractive Speedometer and Gear Indicator</li>\r\n									<li><span></span> Comfortable and with Low Height Seat, Powerful Road Grip</li>\r\n									<li><span></span> Durable and Easy to Maintain</li>\r\n									<li><span></span> Unique and Stylish Graphic Design</li>\r\n									<li><span></span> 17 Inches Tube Tyre</li>\r\n									<li><span></span> Stylish Head Light, Fuel Tank, Colline, Muffler and Fender</li>\r\n\r\n									\r\n									</ul>	\r\n									\";}}'),
