(1599, 410, 'tab_group_info', 'a:2:{i:0;a:2:{s:9:\"tab_title\";s:6:\"Review\";s:8:\"tab_desc\";s:0:\"\";}i:1;a:2:{s:9:\"tab_title\";s:8:\"Features\";s:8:\"tab_desc\";s:1122:\"<ul class=\"features\">\r\n<li><span>Engine</span> 656cm^3  Displacement</li>\r\n									<li><span>Fuel Capacity</span> 19 L (5.0 US gal) </li>\r\n<li><span>Transmission</span> 6-speed , with a hydraulic clutch actuation system</li>\r\n<li><span>Others</span> 1340cc, 4-Stroke, 4-Cylinder, Liquid-Cooled, DOHC Engine</li>\r\n									<li><span></span> Telescopic, Coil Spring, Oil Damped Front Suspension</li>\r\n									<li><span></span> Link Type, Coil Spring, Oil Damped Rear Suspension</li>\r\n									<li><span></span> Automatic Idle Speed Control (ISC) system</li>\r\n									<li><span></span> Electronic Ignition (Transistorized)</li>\r\n									<li><span></span> Suzuki Dual Throttle Valve (SDTV) fuel injection system </li>\r\n									<li><span></span> Analog tachometer, LCD digital speedometer, fuel gauge and clock, and gear-position and other indicator</li>\r\n									<li><span></span> Antilock Braking System (ABS) monitors wheel speed, and (matches stopping power to available traction.</li>\r\n									<li><span></span> (High / Low) Adjustable Seats</li>\r\n									<li><span></span> Instrument Cluster</li>\r\n									</ul>	\";}}'),
