(4167, 502, '_yoast_wpseo_metadesc', 'When put against the specs, Yamaha YBR125 2018 price in Pakistan makes it one of the most economical sports standard bikes in the market. With towering stature and powerful performance, it cost a little over one lakh rupees. This self-starter, 4-stroke bike supports 5-speed constant mesh transmission system.'),
(4170, 1016, '_edit_last', '1'),
(4174, 431, '_yoast_wpseo_metadesc', 'Suzuki GSXR 600 2018 is one of the best performing heavy bikes with as powerful engine as that of a car! This heavy bike is second only to its 1000cc sibling, the Suzuki GSXR 1000. Being a sports and racing bike of the elite class, Suzuki GSXR 600 price in Pakistan is around twice the price of a 600cc car.'),
(4180, 1019, '_vc_post_settings', 'a:1:{s:10:\"vc_grid_id\";a:0:{}}'),
(4179, 425, '_yoast_wpseo_metadesc', 'A bit more powerful than the Yamaha YBR125, the all new Suzuki GR150 2018 exhibits almost the same style and stature with some additional tweaks. It has got a sleek, puristic design with perfectly aerodynamically crafted body. Suzuki GR150 2018 price in Pakistan is around twice as much as that of YBR125 from Yamaha.'),
