(4326, 1058, '_vc_post_settings', 'a:1:{s:10:\"vc_grid_id\";a:0:{}}'),
(4336, 1058, '_edit_lock', '1524295531:1'),
(4331, 494, '_yoast_wpseo_metadesc', 'Do you know Yamaha YBR125Z price in Pakistan is around 15,000 less than that of its sportier counterpart YBR125 from the same manufacturer? It is one of the most economical bikes in the 125cc category. It is equipped with all the advanced features, like self-starting, 5-speed gearbox and 35W x 35W headlight.'),
(4335, 1058, '_edit_last', '1'),
(4334, 127, '_yoast_wpseo_metadesc', 'A new entrant in the market, Keeway is gradually winning a space in the hearts of sports bike fans. It has got a totally unique gradually backward sloping style, least visible in any other bike. Drabbed in decent black hue, the bike has a powerful 200cc machine with flat and grippy tyres mounted on slice-cut wheels.'),
(4342, 1061, '_vc_post_settings', 'a:1:{s:10:\"vc_grid_id\";a:0:{}}'),
(4341, 131, '_yoast_wpseo_metadesc', 'Promising to take your experience of biking to new heights, this junior sibling of Keeway Superlight 200 is different in style and performance. While more comfortable in design, it generates less power. Safety features are above the par. Keeway Superlight 150 2018 price in Pakistan is nearly three lakh rupees. Fine?'),
