(389, 1, '2018-04-10 07:17:49', '2018-04-10 07:17:49', '	<div class=\"car-fea-info\">\r\n									\r\n									<h2>Suzuki Intruder Review</h2>\r\n								<p>Suzuki Intruder M800 is one of the greatest Japanese wonders for sports bikers who are not willing to settle for anything less than exceptional power, outstanding performance and the most impressive style. If you want to fulfill the dream of gliding with elegance and enjoying extreme comfort, just give this fantastic two-wheeler a chance! Even its physical appearance is not less than a marvel as the classic fuses with the contemporary to bring a unique design to the world of motorcycles.</p>\r\n										<h4>Compact & Comfortable Body Dimensions:</h4>\r\n								<p>With the body dimensions of 2,420 mm in length and 890 mm in width, Suzuki Intruder is a compact bike. For its parking, you don’t need a lot of space in your garage. The cruiser is perfect for medium to short height individuals as it stands just 1,105 mm high. At a comparatively low height of 700 mm, the seat has also been fixed comfortably. The contoured surface of the luxurious seat brings a feeling of ease even when you spend hours roaming around on the bike. By placing the seat comparatively low, you can ensure that the center of gravity is located low. In this way, you can balance and handle the bike more conveniently whether it is in full motion or merely standing still.</p>\r\n						\r\n								<h4>Exquisite Design & Outlook:</h4>\r\n								<p>With its gleaming trapezoid shaped headlight, the confident Intruder never fails to bedazzle the eager viewers. The sturdy exhaust pipes have been structured elegantly to add to the dynamic look of the bike, and for this purpose, the designers have put a great deal of laborious effort. The uniqueness in the design of the fuel tank also proves how the Japanese manufactures had been determined to produce something extremely innovative which the world had never witnessed before. The sporty look and sparkling chrome all over the body of the Intruder make it a real head turner for the energetic Pakistani youth.</p>\r\n								<p>The bike wins the hearts of its fans in two colors, viz. entirely black and silver where the former is for those who want a bold appearance while the latter is meant for a more contemporary look.</p>\r\n								<h4>Ultra Power 4-Stroke Engine:</h4>\r\n								<p>The spectacular looking sporty vehicle will definitely prove to be your lifelong companion, and keep on impressing you when it runs powerfully with Suzuki’s high class features incorporated in it to give the performance you desire. Giving it ultra power, there is a four stroke, two cylinder 450 V-Twin engine with transistorized electronic ignition system. The displacement of 805 cc, enables it generate optimum output for both your city and highway travelling requirements. More precisely, the power of 52 bhp (brake horsepower) at 6000 rmp with the torque of 68.3 NM at 4000 rmp propels the lightweight motorcycle in the forward direction, helping it go from zero to 100 km/hour within seconds. The package for an ideal performance comes to its ultimate completion with the compression ratio of 9.4:1 along with 83.0 mm bore and 74.4 mm stroke.</p>\r\n							\r\n								<h4>Dual Throttle Valve:</h4>\r\n								<p>In order to ensure the extreme level of efficiency, Suzuki manufacturers have incorporated the impressive Dual Throttle Valve as well as the most up-to-date digital fuel injection system. The technologically advanced systems not only give you fuel economy, but also ensure linear power with the help of an ideal throttle response.</p>\r\n								<h4>Perfect Road Grip:</h4>\r\n								<p>With the wheelbase measuring 1,655 mm and the ground clearance of 140 mm, your motorbike runs with super fast speeds without losing contact with the road. Even on the slippery, bumpy or broken roads, it will be having perfect grip on the ground so that you may drive with ease without any danger of meeting with a unfortunate accident.</p>\r\n								\r\n								<h4>Safety Measures:</h4>\r\n								<p>For ensuring the utmost safety of the rider, ordinary rear drum brakes combine with the 300mm, two piston caliper disc brakes at the front so that the fast moving bike is brought to a halt without jerks or dangers of toppling over. Even an abrupt decrease in the speed will make you feel an instant response and a smooth transition.</p>\r\n								<h4>Price Factor:</h4>\r\n								<p>No doubt the Suzuki Intruder price in Pakistan might be unaffordable for the low income fans of the company’s products, but once you go for the real experience of its extraordinary features, this cost will seem to be fairly less than the actual worth of the vehicle.</p>\r\n							\r\n														<h4>Bottom Line:</h4>\r\n														<p>The enthusiastic two-wheeler vehicle, Intruder M800, has been designed, especially, for the long highway journeys. But you cannot expect from it something beyond the limits. That is why though it gives you a smooth ride over the bumpy roads, too many rough patches and pot holes on the road can pose a strain on your shoulders. Therefore, take your machine only to the smooth tracks for its optimum performance and enjoy what it has actually been designed for.</p>\r\n								</div>', 'Suzuki Intruder Price, Pictures and Features in Pakistan - Heavy Bike', '', 'inherit', 'closed', 'closed', '', '388-revision-v1', '', '', '2018-04-10 07:17:49', '2018-04-10 07:17:49', '', 388, 'http://bike.qeemat.com/uncategorized/388-revision-v1.php', 0, 'revision', '', 0),
(29, 1, '2018-04-06 08:04:01', '2018-04-06 08:04:01', '<div class=\"car-fea-info\">\r\n									\r\n								<p>Suzuki is a reliable brand and always introduces new products with wonderful features. The competitor of Suzuki is Honda, market leader that always introduced new improved motorbikes. Suzuki launched a new motorcycle, Suzuki Sprinter 2012 to make your drive memorable and luxurious. It is a positive addition in the Suzuki product line to compete its competitors like Yamaha and Honda. The main competitor of Suzuki sprinter 2012 is Yamaha 100cc but Suzuki Sprinter is having advanced features as compared to Yamaha 100cc. Suzuki Sprinter gives you more value and it is a competitive product. It is an economical as well as ecological bike as it consumes less fuel. The features of Suzuki Sprinter 2012 resemble with the features of Suzuki Sprinter ECO 2012. But the Price of Suzuki Sprinter 2012 in Pakistan is high as compared to Suzuki Sprinter ECO 2012.</p> \r\n										<h4>Features</h4>\r\n								<p>Favorable points for this motorbike are 4-Stroke air cooled engine, kick start system, 10.5 liters fuel tank capacity, fuel efficient etc. Its suspension system and drum brakes make this motor bike a good option for purchase. The seats are comfortable and having large grab bars to give you support while riding.</p>\r\n								\r\n								<h4>Design and outlook</h4>\r\n								<p>Suzuki Sprinter is a good looking bike that is available in two popular colors, black and red. It has well shaped and powerful front lights to enhance the visibility. Its seats are durable and covered with premium quality fabric. The speed meter of the motorbike is prominent so that rider might not feel difficulty while driving the bike.</p>\r\n								<h4>Engine and performance</h4>\r\n								<p>The engine of Suzuki Sprinter is 4-stroke with 110cc power that gives a smooth ride. It has 4-stroke air-cooled single cylinder that assures efficiency of the engine. It is kick start motor bike and 4-speed manual transmission system. The capacity of fuel tank is 10.5 liters which is quite sufficient. The engine is powerful, fuel efficient and also gives impressive mileage of 55 to 60 Km /L on average. Another benefit of this motorbike is that, it can move the heavy loads with ease. For this reason it is used for luggage transport services.</p>\r\n								<h4>Drawbacks</h4>\r\n								<p>The drawback of this motor bike is that, its resale value is very low in Pakistani market. People in Pakistan, mostly like Honda motorbikes therefore Suzuki Motorbikes have not been successful in attracting good sales in the country.</p>\r\n								</div>', 'Suzuki Sprinter 2012 Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '26-revision-v1', '', '', '2018-04-06 08:04:01', '2018-04-06 08:04:01', '', 26, 'http://bike.qeemat.com/uncategorized/26-revision-v1.php', 0, 'revision', '', 0),
