(26, 1, '2012-09-13 08:04:01', '2012-09-13 08:04:01', '<div class=\"car-fea-info\">\r\n									\r\n								<p>Suzuki is a reliable brand and always introduces new products with wonderful features. The competitor of Suzuki is Honda, market leader that always introduced new improved motorbikes. Suzuki launched a new motorcycle, Suzuki Sprinter 2012 to make your drive memorable and luxurious. It is a positive addition in the Suzuki product line to compete its competitors like Yamaha and Honda. The main competitor of Suzuki sprinter 2012 is Yamaha 100cc but Suzuki Sprinter is having advanced features as compared to Yamaha 100cc. Suzuki Sprinter gives you more value and it is a competitive product. It is an economical as well as ecological bike as it consumes less fuel. The features of Suzuki Sprinter 2012 resemble with the features of Suzuki Sprinter ECO 2012. But the Price of Suzuki Sprinter 2012 in Pakistan is high as compared to Suzuki Sprinter ECO 2012.</p> \r\n										<h2>Features</h2>\r\n								<p>Favorable points for this motorbike are 4-Stroke air cooled engine, kick start system, 10.5 liters fuel tank capacity, fuel efficient etc. Its suspension system and drum brakes make this motor bike a good option for purchase. The seats are comfortable and having large grab bars to give you support while riding.</p>\r\n								\r\n								<h2>Design and outlook</h2>\r\n								<p>Suzuki Sprinter is a good looking bike that is available in two popular colors, black and red. It has well shaped and powerful front lights to enhance the visibility. Its seats are durable and covered with premium quality fabric. The speed meter of the motorbike is prominent so that rider might not feel difficulty while driving the bike.</p>\r\n								<h2>Engine and performance</h2>\r\n								<p>The engine of Suzuki Sprinter is 4-stroke with 110cc power that gives a smooth ride. It has 4-stroke air-cooled single cylinder that assures efficiency of the engine. It is kick start motor bike and 4-speed manual transmission system. The capacity of fuel tank is 10.5 liters which is quite sufficient. The engine is powerful, fuel efficient and also gives impressive mileage of 55 to 60 Km /L on average. Another benefit of this motorbike is that, it can move the heavy loads with ease. For this reason it is used for luggage transport services.</p>\r\n								<h2>Drawbacks</h2>\r\n								<p>The drawback of this motor bike is that, its resale value is very low in Pakistani market. People in Pakistan, mostly like Honda motorbikes therefore Suzuki Motorbikes have not been successful in attracting good sales in the country.</p>\r\n								</div>', 'Suzuki Sprinter 2012 Price in Pakistan', '', 'publish', 'open', 'open', '', 'suzuki-sprinter-2012-price-in-pakistan', '', '', '2018-04-17 07:35:42', '2018-04-17 07:35:42', '', 0, 'http://bike.qeemat.com/?p=26', 0, 'post', '', 0),
(32, 1, '2016-07-26 08:43:02', '2016-07-26 08:43:02', '<div class=\"car-fea-info\">		\r\n								<p>UniPak presents itself as the most trustworthy and reliable company, which is working to manufacture 70CC motorcycles in Pakistan. Following the targets of making the product which is equipped with latest engineering, it has introduced AU-70 CC bike. UniPak is proving itself as the most cost effective and efficient bike makers with multi functions and features. AU-70 CC prices in Pakistan are comparatively lower to its competitors like Honda CD 70.</p>\r\n<p>On the road, you will find it going more than 70km per liter, which is the basic need, as the oil prices are getting higher. The bike is designed with beautiful color combination and attractive graphics on the oil tank and side covers, solid and comfortable seat that avoids jumps to affect your back, powerful front and rear shocks with good suspension, crystal indicators, back and headlights, energetic four stroke engine that don\'t pollute the environment and engine jamming risks. The head of Speedo meter is really stylish and astounding. Au-70 CC can preserve 9 liters of petrol for long drive. One thing is important to note that AU-70CC loses its pick after some years and the engine gets weaker as compared to Honda CD 70. Overall, this 83kg, lightweight bike is capable to compete with other bikes in the market, as the fundamental features are attractive and worthy to experience. The ignition is equipped with the latest CDI capacitor discharge ignitions system that does not require any adjustment.</p></div>', 'Unipak AU 70 Price in Pakistan | Unipak CDI AU-70', '', 'publish', 'open', 'open', '', 'unipak-au-70-price-in-pakistan', '', '', '2018-04-18 11:08:18', '2018-04-18 11:08:18', '', 0, 'http://bike.qeemat.com/?p=32', 0, 'post', '', 0),
