(35, 1, '2018-04-07 08:43:02', '2018-04-07 08:43:02', '<h2>Unipak AU 70 Review</h2>\r\n								\r\n								<p>UniPak presents itself as the most trustworthy and reliable company, which is working to manufacture 70CC motorcycles in Pakistan. Following the targets of making the product which is equipped with latest engineering, it has introduced AU-70 CC bike. UniPak is proving itself as the most cost effective and efficient bike makers with multi functions and features. AU-70 CC prices in Pakistan are comparatively lower to its competitors like Honda CD 70.</p>\r\n<p>On the road, you will find it going more than 70km per liter, which is the basic need, as the oil prices are getting higher. The bike is designed with beautiful color combination and attractive graphics on the oil tank and side covers, solid and comfortable seat that avoids jumps to affect your back, powerful front and rear shocks with good suspension, crystal indicators, back and headlights, energetic four stroke engine that don\'t pollute the environment and engine jamming risks. The head of Speedo meter is really stylish and astounding. Au-70 CC can preserve 9 liters of petrol for long drive. One thing is important to note that AU-70CC loses its pick after some years and the engine gets weaker as compared to Honda CD 70. Overall, this 83kg, lightweight bike is capable to compete with other bikes in the market, as the fundamental features are attractive and worthy to experience. The ignition is equipped with the latest CDI capacitor discharge ignitions system that does not require any adjustment.</p>', 'Unipak AU 70 Price in Pakistan | Unipak CDI AU-70', '', 'inherit', 'closed', 'closed', '', '32-revision-v1', '', '', '2018-04-07 08:43:02', '2018-04-07 08:43:02', '', 32, 'http://bike.qeemat.com/uncategorized/32-revision-v1.php', 0, 'revision', '', 0),
(36, 1, '2016-09-11 08:55:14', '2016-09-11 08:55:14', '<div class=\"car-fea-info\">	\r\n								<p>Crown is a living picture of reality. A motorcycle company established with the cooperation of China. Keeping in mind the growing importance of engine and fuel efficiency, Crown has introduces its latest CRLF-70CC bike in the market, which is powerful and more dynamic. The Crown CRLF 70 prices in Pakistan are of immense value to be compared, as there are so many bikes manufacturing companies in the market.</p>\r\n<p>Telling you its features, you will find it similar to other bikes. The only difference which keeps the CRLF 70CC different from other 70 CC bikes is that, it has dual options of self-start ignition and kick-start with manual gears. The bike speeds up to 80km to 90km per hour quite easily and covers more than 70km per liter, which shows that it is a fuel-efficient motorcycle. It has the fuel storage capacity of 9 liters. The overall weight of CRLF 70CC bike is 85 kg, which is little more than <a href=\"http://bike.qeemat.com/china/metro-mr-70-price-in-pakistan.php\">Metro MR 70</a> and <a href=\"http://bike.qeemat.com/china/unipak-au-70-price-in-pakistan.php\">UniPak AU 70</a> bikes. The compression and displacement of bike is same as others. Externally, the bike is impressive with multicolor designs on the fuel tanks and on the side covers. The drive is smooth and comfortable with the resistive suspension system installed in its shocks. The headlights and indicators are all crystal that shines more at night. As the bike is new, so it will take time to make the company popular and trustworthy among the bike riders in Pakistan.</p></div>', 'Crown CR 70 Price in Pakistan | Crown Motorcycle', '', 'publish', 'open', 'open', '', 'crown-cr-70-price-in-pakistan', '', '', '2018-04-18 11:04:43', '2018-04-18 11:04:43', '', 0, 'http://bike.qeemat.com/?p=36', 0, 'post', '', 0),
