(45, 1, '2018-04-07 09:00:30', '2018-04-07 09:00:30', '<h2>Ghani GI 70 Review</h2>\r\n								\r\n								<p>Ghani is a new automobile company started its journey in 2005. It has gained a lot of confidence in its manufacturing sector. These bikes are stylish, comfortable and fuel economical. I must tell you one thing that 70cc and 125cc bikes are most commonly used in Pakistan because of its midrange price and easy drive. That’s why most of the companies are heading towards the manufacturing of 70cc and 125cc models.</p>\r\n<p>Ghani automobiles have also targeted the same market with one of its new model Gi70 cc. This bike has been carefully designed from its interior and exterior. Let’s figure it out. Internally, this bike is furnished with a 4-Stroke Air Cooled OHC engine that is of 70cc power and it can cover almost 84km per liter of petrol. It has two types of models; one that is a self-starter with remote control while the other is kick start. It can store up to 9 liters of petrol in its oil tank.</p>\r\n								<p>Externally, it is a stylish one with enticing Alloy Rims, Heavy Duty Front Shock Absorbers, and Adjustable Rear Shock, black handles and clutches, colorful head with RPM & Speedo Meter with the option of Gears Indication. It highlights the no. of gear on which the bike is running on. The overall running is quite light and comfortable. You can compare Ghani Gi 70cc price with other bikes in Pakistan. Overall, this new bike gives you more mileage, 2 years or 12000 km warranty where as other companies gives you lesser warranty. You can get the real pleasure of Ghani bikes.</p>', 'Ghani Gi 70 Price in Pakistan | Gi 70CC', '', 'inherit', 'closed', 'closed', '', '42-revision-v1', '', '', '2018-04-07 09:00:30', '2018-04-07 09:00:30', '', 42, 'http://bike.qeemat.com/uncategorized/42-revision-v1.php', 0, 'revision', '', 0),
(46, 1, '2016-09-02 09:04:33', '2016-09-02 09:04:33', '<div class=\"car-fea-info\"><p>As the economy is falling down, oil prices are increasing; bikes have become the only lifeline for most of the mediocre working class to cover their distances in lowest possible costs. The competitors are struggling hard to introduce such bikes that are good looking, energy efficient and durable. With this strategy, Metro has brought into the competition its new model-MR70. This bike has two editions, one is simple and the other is a special one.</p>\r\n<p>You can check Metro MR70 prices in Pakistan for both the editions. Mostly, companies design bikes that are almost same in nature and specifications. But, Metro has designed something new in its bikes. From front to back, the looks are different. Apart from the simple MR70 bike, Metro has also launched Metro Boom, Metro Jeet and not to forget the one and only, Metro Dabang.</p>\r\n								<p>Talking specifically about the Speedometer, Metro is one of the first bike makers to introduce digital speedometer even in normal models. The indicators, rear break light and headlights all are unique. The indicators are oval in shape and brake lights are stretched and broader. The liver is different from the other bikes with more stylish looks, and even side mirrors are smartly designed.</p>\r\n								<p>This time the monogram and stickers are more pleasing and different as well. To control the efficiency of this motorcycle and to make it more comfortable, durable and reliable, the bike is powered with four stroke OHC system and latest CDi system. The torque and horsepower is 70 CC. Metro Pakistan can store 9 liters of petrol in its tank and weighs almost 82kg, less than other local bikes available in Pakistan.</p></div>', 'Metro MR 70 Price in Pakistan | Metro Pakistan', '', 'publish', 'open', 'open', '', 'metro-mr-70-price-in-pakistan', '', '', '2018-04-18 10:28:06', '2018-04-18 10:28:06', '', 0, 'http://bike.qeemat.com/?p=46', 0, 'post', '', 0),
