(50, 1, '2016-08-24 09:08:12', '2016-08-24 09:08:12', '<div class=\"car-fea-info\"><p>Qingqi is a Chinese bike recently introduced in Pakistan. It has been designed and manufactured with latest technology, meeting people’s needs and demands. Qingqi is 100cc four stroke powerful bikes with low consumption of fuel, making it efficient and effective for its riders. In Pakistan mostly two shapes of bikes are famous, one is like CD 70 and the other one is like CG 125. This Qingqi is a combo of both CD and CG. Not so heavy and not so light, but gives you immense pleasure once you are on to it.</p>\r\n<p>Externally, it is carefully designed with appealing color combination and aerodynamics. Soundless shinning silencer, powerful double point headlight with sporty touch, high- tech and more visible crystal brake lights and indicators, heavy mud guards and durable tyers make its ride comfortable and impressive. Internally, you will find it long lasting, less sound producing engine as compared to other bikes with O.H.V intake system, 12V CDI ignition, 4 speed transmissions, and big fuel tank with 9.8 liter of capacity which is more than other available bikes in Pakistan of this range. It can store 1.5 liter of fuel as reserve. You can compare Qingqi CD100 prices in Pakistan with other company bikes that are in competition with it. Go and get experience with Elite four strokes CD100Q for better life.</p></div>', '2016 Qingqi CD 100 Price in Pakistan', '', 'publish', 'open', 'open', '', 'qingqi-cd-100-price-in-pakistan', '', '', '2018-04-18 08:30:31', '2018-04-18 08:30:31', '', 0, 'http://bike.qeemat.com/?p=50', 0, 'post', '', 0),
