(241, 1, '2018-04-18 07:51:23', '2018-04-18 07:51:23', '<div class=\"car-fea-info\"><p>Amongst all the many bikes out there, Metro bikes are one of the most stylish, as well as accessible bikes. Despite sharing similar features and prices with other bikes, Metro 70 CC bikes manage to stand out and make themselves noticeable through their style and elegance. However, they aren’t just good looking; the Metro 70 CC bikes are also great in their performance and specifications. Built using the finest parts, the Metro MR 70 Jeet is one of the best amongst these Metro bikes.</p> \n<p>When we talk about the Metro MR70 Jeet, the first thing in discussion is its engine. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. The bike has a good 72CC piston displacement, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, which makes it atmosphere friendly. All of these impressive features make the bike an instant hit, even though there’s lot more to come.</p>\n<p>The Metro MR70 Jeet has a lot more to offer in and out of its splendid exterior. The bike is 1885mm long, 760mm wide, and 990mm tall; and has a dry weight of 82 Kg. Within this structure of sleek and shiny material, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals. Its fuel tank capacity is of 9 liters and there is an additional 1 liter reserve. Keeping up with the good set standards, its transmission type is four speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life.</p>\n								<p>The Metro MR70 is not deprived of any feature; in fact the most basic of features are enhanced in this bike. It contains a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch; all of them in a better quality standard than competing products. This makes the overall experience of the bike different from what has been experienced before.</p>\n								<p>Available in black and red, with a distinctive blue colored design on its shiny body, this bike is a win-win situation in both colors. However, the fact stands strong that the color black is most preferred since it gives a more sophisticated look to the bike. The glass finish on the bike adds to its appearance and makes it look more stylish from all angles.</p>\n								<p>The Metro MR70 Jeet is a complete package with its strong engine, solid built, trustworthy fuel system, glossy outlook and a reliable torque (max) of 5.39 N-m@6,500rpm/min. Maintained properly, this bike could last you for years and prove to be a great investment. With readily available parts and a smooth drive, your time spent with this bike will always remain a good experience.</p></div>', 'Metro Jeet Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '88-autosave-v1', '', '', '2018-04-18 07:51:23', '2018-04-18 07:51:23', '', 88, 'http://bike.qeemat.com/uncategorized/88-autosave-v1.php', 0, 'revision', '', 0),
(59, 1, '2015-04-21 09:18:39', '2015-04-21 09:18:39', '<div class=\"car-fea-info\"><p>There are so many companies in Pakistan that are manufacturing various types and models of bikes including 70cc, 100cc and 125cc for the convenience of customers. Similarly, Super Star is one of them, established in 1994 that assembles bikes on modern plants with high technology involved in it. With continuous research and improvement it has designed an awesome bike named as SUPER STAR SS -70. This is a blend of excellent new features and figures.</p>\r\n<p>Internally, it is manufactured with SS-70 runs with 4 Stroke engine, 4-speed manual transmission, Single Cylinder, Air Cooled and Overhead Cam Shaft. Its Compression Ratio is 8.8:1 and ignition is CDI, Suspension Rear Dual Dumpers with 5-step adjustable spring preload, rated power of 4.2KW, multi plated wet clutch and drum brakes. The fuel consumption is very economical as it covers 100km in 1.4 Liter of petrol. SS-70 has got a vibrant exterior with improved front fork, attractive stickers on the tank and side covers, stylish digital meter that gives you accurate running and mileage, crystal rear and front headlights and indicators as well. Overall, this bike has gorgeous and high quality color finishing, with more lighter, compact and powerful engine that rounds up to maximum power with just a little movement of hand. The Super Star SS-70cc price can be compared with other models available in Pakistan. Try the new discovery of amazing features introduced by Super Star automobiles.</p></div>\r\n', 'Super Star Motorcycle Price in Pakistan | SS 70 Bike', '', 'publish', 'open', 'open', '', 'super-star-motorcycle-price-in-pakistan', '', '', '2018-04-18 08:26:29', '2018-04-18 08:26:29', '', 0, 'http://bike.qeemat.com/?p=59', 0, 'post', '', 0),
