(65, 1, '2012-10-07 09:21:38', '2012-10-07 09:21:38', '<div class=\"car-fea-info\"><p>Due to increasing rates of oil and petrol in Pakistan, many people have shifted from cars to motorbikes, making it their life line to move around. Keeping in view the above situation in Pakistan, Skywing is offering it’s newly designed SW -70CC bike that meets the present and future demand effectively and efficiently.</p>\r\n<p>The external and internal standards of the bike are almost same as all other bikes available in Pakistan but there is little difference in its design. You can see Skywing SW-70CC price in Pakistan and compare them with other models of various companies. Explaining it externally, you will see SW-70 CC in two ritual colors black and red. The design on tanks and side covers are different from others. It has got crystal headlight, brake light and indicators, Shinning silver rims and mudguards, intellectual and enticing Speedometer that is marked up to 120Km. Internally, the bike is installed with fuel tank having 9 liter fuel capacity, 0.55kg-m/6500 of torque rate, 5.3mm ground clearance, strong suspension system and adjustable gear box. The bike is really good, but the engine quality and durability is not that efficient as Honda CD70. The bike price is good for mediocre range people. Get go with it and mark your life with peaceful ride.</p></div>', 'Skywing Motorcycle Price in Pakistan | SW70 Bike', '', 'publish', 'open', 'open', '', 'skywing-motorcycle-price-in-pakistan', '', '', '2018-04-18 08:23:14', '2018-04-18 08:23:14', '', 0, 'http://bike.qeemat.com/?p=65', 0, 'post', '', 0),
