(84, 1, '2013-04-07 09:44:47', '2013-04-07 09:44:47', '<div class=\"car-fea-info\"><p>Metro bikes are the most stylish and elegant looking 70 CC bikes in Pakistan. There are many bikes out there that offer similar features in competitive prices; however when it comes to design and style the best one amongst all is the Metro Bike MR 70-Boom. Metro Bikes are a combination of the most stylish parts of a motorbike. Many features make this bike different from other 70 CC bikes, making this motorcycle stand distinct from the rest.</p>\r\n<p>Coming to the engine of the bike, the bike contains a single cylinder and a four stroke engine with two valves with air cooled system. The piston displacement of the bike is 72 CC. The bike is a kick starter as all other 70 CC bikes. One key feature of the engine is one into one exhaust system that keeps the engine cool to a certain temperature.</p>\r\n								<p>The engine oil capacity is 800 ML in the first fill whereas on changing intervals the bike requires 700 ML engine oil. The transmission type of the bike is Four Speed Constant Mesh. The length of the bike is 1885 mm with the width of 760 mm and the height of 990 mm. The weight of the motorbike is very accurate according to the design and layout of the bike. It weighs only 82 kg. The fuel storage capacity is 9 liters including one liter for the reserve storage.</p>\r\n<p>Now, the first feature that makes Metro MR 70 Boom for other 70 CC bikes is the speedometer. The bike has a digital speedometer. The Metro MR 70 Boom is the only bike featuring a digital meter in the same price as of other bikes. The advantage of digital meter is that it gives more precise reading as compared to the ordinary meter. The backlight of the motorbike is unique in shape and elegant in design. The backlight of this bike is similar to the backlight of Honda CG 125.</p>\r\n								<p>The Metro MR 70 is available in two colors; black and red. Red is the most demanded color for this motorbike whereas the black color has its own attraction. The front light of the bike has a glossy outlook and a crystal cover glass that makes the front look of the bike extremely attractive. The stylish rear and front side winkers also are a great addition to the well-designed Metro MR 70.</p>\r\n								<p>There is special Metro oil as well especially designed for the Metro bike’s engine according to its requirements. Overall, the Metro MR 70 is a stylish bike with the most modish parts installed in it. It has an aerodynamic drive that enhances the comfort level of its ride. The engine is also very strong, fast ride with the smoothing element, digital meter and glossy lights are the features that makes this bike the most attractive one. You will have a great experience using this bike.</p>\r\n</div>', 'Metro MR 70-Boom Price in Pakistan', '', 'publish', 'open', 'open', '', 'metro-boom-price-in-pakistan', '', '', '2018-04-18 08:06:31', '2018-04-18 08:06:31', '', 0, 'http://bike.qeemat.com/?p=84', 0, 'post', '', 0),
