r for this motorbike whereas the black color has its own attraction. The front light of the bike has a glossy outlook and a crystal cover glass that makes the front look of the bike extremely attractive. The stylish rear and front side winkers also are a great addition to the well-designed Metro MR 70.</p>\r\n								<p>There is special Metro oil as well especially designed for the Metro bike’s engine according to its requirements. Overall, the Metro MR 70 is a stylish bike with the most modish parts installed in it. It has an aerodynamic drive that enhances the comfort level of its ride. The engine is also very strong, fast ride with the smoothing element, digital meter and glossy lights are the features that makes this bike the most attractive one. You will have a great experience using this bike.</p>', 'Metro MR 70-Boom Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2018-04-07 09:44:47', '2018-04-07 09:44:47', '', 84, 'http://bike.qeemat.com/uncategorized/84-revision-v1.php', 0, 'revision', '', 0),
(88, 1, '2013-04-15 09:52:30', '2013-04-15 09:52:30', '<div class=\"car-fea-info\"><p>Amongst all the many bikes out there, Metro bikes are one of the most stylish, as well as accessible bikes. Despite sharing similar features and prices with other bikes, Metro 70 CC bikes manage to stand out and make themselves noticeable through their style and elegance. However, they aren’t just good looking; the Metro 70 CC bikes are also great in their performance and specifications. Built using the finest parts, the Metro MR 70 Jeet is one of the best amongst these Metro bikes.</p> \r\n<p>When we talk about the Metro MR70 Jeet, the first thing in discussion is its engine. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. The bike has a good 72CC piston displacement, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, which makes it atmosphere friendly. All of these impressive features make the bike an instant hit, even though there’s lot more to come.</p>\r\n<p>The Metro MR70 Jeet has a lot more to offer in and out of its splendid exterior. The bike is 1885mm long, 760mm wide, and 990mm tall; and has a dry weight of 82 Kg. Within this structure of sleek and shiny material, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals. Its fuel tank capacity is of 9 liters and there is an additional 1 liter reserve. Keeping up with the good set standards, its transmission type is four speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life.</p>\r\n								<p>The Metro MR70 is not deprived of any feature; in fact the most basic of features are enhanced in this bike. It contains a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch; all of them in a better quality standard than competing products. This makes the overall experience of the bike different from what has been experienced before.</p>\r\n								<p>Available in black and red, with a distinctive blue colored design on its shiny body, this bike is a win-win situation in both colors. However, the fact stands strong that the color black is most preferred since it gives a more sophisticated look to the bike. The glass finish on the bike adds to its appearance and makes it look more stylish from all angles.</p>\r\n								<p>The Metro MR70 Jeet is a complete package with its strong engine, solid built, trustworthy fuel system, glossy outlook and a reliable torque (max) of 5.39 N-m@6,500rpm/min. Maintained properly, this bike could last you for years and prove to be a great investment. With readily available parts and a smooth drive, your time spent with this bike will always remain a good experience.</p></div>', 'Metro Jeet Price in Pakistan', '', 'publish', 'open', 'open', '', 'metro-jeet-price-in-pakistan', '', '', '2018-04-18 07:54:42', '2018-04-18 07:54:42', '', 0, 'http://bike.qeemat.com/?p=88', 0, 'post', '', 0),
