(101, 1, '2018-04-07 09:52:30', '2018-04-07 09:52:30', '<h2>Metro MR 70-Jeet Review</h2>\r\n								\r\n								<p>Amongst all the many bikes out there, Metro bikes are one of the most stylish, as well as accessible bikes. Despite sharing similar features and prices with other bikes, Metro 70 CC bikes manage to stand out and make themselves noticeable through their style and elegance. However, they aren’t just good looking; the Metro 70 CC bikes are also great in their performance and specifications. Built using the finest parts, the Metro MR 70 Jeet is one of the best amongst these Metro bikes.</p> \r\n<p>When we talk about the Metro MR70 Jeet, the first thing in discussion is its engine. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. The bike has a good 72CC piston displacement, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, which makes it atmosphere friendly. All of these impressive features make the bike an instant hit, even though there’s lot more to come.</p>\r\n<p>The Metro MR70 Jeet has a lot more to offer in and out of its splendid exterior. The bike is 1885mm long, 760mm wide, and 990mm tall; and has a dry weight of 82 Kg. Within this structure of sleek and shiny material, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals. Its fuel tank capacity is of 9 liters and there is an additional 1 liter reserve. Keeping up with the good set standards, its transmission type is four speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life.</p>\r\n								<p>The Metro MR70 is not deprived of any feature; in fact the most basic of features are enhanced in this bike. It contains a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch; all of them in a better quality standard than competing products. This makes the overall experience of the bike different from what has been experienced before.</p>\r\n								<p>Available in black and red, with a distinctive blue colored design on its shiny body, this bike is a win-win situation in both colors. However, the fact stands strong that the color black is most preferred since it gives a more sophisticated look to the bike. The glass finish on the bike adds to its appearance and makes it look more stylish from all angles.</p>\r\n								<p>The Metro MR70 Jeet is a complete package with its strong engine, solid built, trustworthy fuel system, glossy outlook and a reliable torque (max) of 5.39 N-m@6,500rpm/min. Maintained properly, this bike could last you for years and prove to be a great investment. With readily available parts and a smooth drive, your time spent with this bike will always remain a good experience.</p>', 'Metro Jeet Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '88-revision-v1', '', '', '2018-04-07 09:52:30', '2018-04-07 09:52:30', '', 88, 'http://bike.qeemat.com/uncategorized/88-revision-v1.php', 0, 'revision', '', 0),
(102, 1, '2013-08-30 09:59:18', '2013-08-30 09:59:18', '<div class=\"car-fea-info\"><p>What does an ordinary man require from a motorbike? The answer is reliability, worth for his money, fuel efficiency and style and most importantly style. Even though a bike is an ordinary vehicle, easily bought and easily maintained, it does not change the fact that every bike owner wants their bike to be as stylish as can be. This is why Metro has released Metro MR 70 Dabang.</p> \r\n<p>Much like the bikes in the movie Dabang, this bike is also aimed at style, power, reliability and the same sense of action that the movie incorporates. Metro MR 70 Dabang is able to do this through specifications and great performance which makes it a winner. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. With a piston displacement of 72 cm, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, the bike is great at running and also atmosphere friendly.</p>\r\n								<p>The Metro MR 70 is an instant stunner with its good looks outside and is similarly an instant charmer with its great working inside. Being 1885mm long, 760mm wide and 990mm tall; and having a dry weight of 82 Kg, the bike has a perfect size and weight. Then inside this body of fine metal, it comes with a fuel tank capacity of 9 liters and an additional 1 liter reserve. Furthermore, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals.</p>\r\n<p>The transmission type of the bike is four-speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life. This gives the bike the same power of action seen in the movie Dabang. Metro MR 70 Dabang contains style not only through its looks but also through its other features. These include a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch. Since all these features are better than before, they provide an all together new experience of power and style within a 70 CC bike.</p>\r\n<p>The bike comes in two colors: black and red, with a sleek blue design covering its strong body. The fact that the color black is more popular stands strong, and that is not only due to its association with the movie Dabang, but because of the sleekness of the color black on this bike. However that does not mean that the bike does not look any good in red.</p>\r\n								<p>Features like a strong engine, glossy outlook, reliable torque (max) of 5.39 N-m@6,500rpm/min, solid built, and trustworthy fuel system give the bike an edge over others. Finding parts are no difficulty with this bike, neither is maintenance or running.</p>\r\n								<p>Overall the style of the Metro MR 70 Dabang forms its identity and its performance takes it further ahead.</p></div>', 'Metro MR 70 Dabang Price in Pakistan', '', 'publish', 'open', 'open', '', 'metro-mr-70-dabang-price-in-pakistan', '', '', '2018-04-18 07:38:08', '2018-04-18 07:38:08', '', 0, 'http://bike.qeemat.com/?p=102', 0, 'post', '', 0),
