(106, 1, '2018-04-07 09:59:18', '2018-04-07 09:59:18', '<h2>Metro MR 70-Dabang Review</h2>\r\n								\r\n								<p>What does an ordinary man require from a motorbike? The answer is reliability, worth for his money, fuel efficiency and style and most importantly style. Even though a bike is an ordinary vehicle, easily bought and easily maintained, it does not change the fact that every bike owner wants their bike to be as stylish as can be. This is why Metro has released Metro MR 70 Dabang.</p> \r\n<p>Much like the bikes in the movie Dabang, this bike is also aimed at style, power, reliability and the same sense of action that the movie incorporates. Metro MR 70 Dabang is able to do this through specifications and great performance which makes it a winner. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. With a piston displacement of 72 cm, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, the bike is great at running and also atmosphere friendly.</p>\r\n								<p>The Metro MR 70 is an instant stunner with its good looks outside and is similarly an instant charmer with its great working inside. Being 1885mm long, 760mm wide and 990mm tall; and having a dry weight of 82 Kg, the bike has a perfect size and weight. Then inside this body of fine metal, it comes with a fuel tank capacity of 9 liters and an additional 1 liter reserve. Furthermore, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals.</p>\r\n<p>The transmission type of the bike is four-speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life. This gives the bike the same power of action seen in the movie Dabang. Metro MR 70 Dabang contains style not only through its looks but also through its other features. These include a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch. Since all these features are better than before, they provide an all together new experience of power and style within a 70 CC bike.</p>\r\n<p>The bike comes in two colors: black and red, with a sleek blue design covering its strong body. The fact that the color black is more popular stands strong, and that is not only due to its association with the movie Dabang, but because of the sleekness of the color black on this bike. However that does not mean that the bike does not look any good in red.</p>\r\n								<p>Features like a strong engine, glossy outlook, reliable torque (max) of 5.39 N-m@6,500rpm/min, solid built, and trustworthy fuel system give the bike an edge over others. Finding parts are no difficulty with this bike, neither is maintenance or running.</p>\r\n								<p>Overall the style of the Metro MR 70 Dabang forms its identity and its performance takes it further ahead.</p>', 'Metro MR 70 Dabang Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '102-revision-v1', '', '', '2018-04-07 09:59:18', '2018-04-07 09:59:18', '', 102, 'http://bike.qeemat.com/uncategorized/102-revision-v1.php', 0, 'revision', '', 0),
(107, 1, '2016-05-16 10:03:55', '2016-05-16 10:03:55', '<div class=\"car-fea-info\">\r\n<p>The Eagle 70 is a small four stroke motor cycle produced recently by Eagle. Introduced to compete against rival two-stroke small capacity motor cycles, the Eagle DG 70 Firebird is a four-stroke, small capacity motor cycle, with an engine displacement of only 72 cm³. With Eagle’s specialty four-stroke technology, getting extra mileage from every cc that will take you onto the road ahead of everybody. The new eye-catching graphics, comfortable new seat design and its exquisite aero dynamic shape have made it a best choice and a perfect partner, longer better cushioned seat makes the going more comfortable for one up or two up riding!</p> \r\n<p>The newly introduced Eagle DG 70 is very cheap to operate with a typical fuel economy of 40 miles (64 kilometers) in a liter which promises you the most economical ride of your life. A solid, reliable and very practical competitor, this bike offers 50 cc economy with a power of 70 cc vehicle. The tank carries a 10 liters and a petrol reserve capacity of 1 liter too. The vehicles fuel capacity that is one liter more than Honda CD 70 whose tank carries a maximum fuel capacity of 9 liters.</p>\r\n								<p>The Eagle Firebird comes loaded with a 78 cc engine that is air cooled, 4 strokes, and single cylinder, the new improved motor bike produces a top power of 7.0 PS at 6500 rpm and a peak torque of 5.4 nm at 6500 rpm. The splendidly designed vehicle uses a 4 speed gearbox which follows all down gear shifting pattern. It comes with a CDI ignition and handles lock. The starting pattern is kick start only.</p>\r\n<p>The Eagle bike has been equipped with standard brakes and suspension. The motor has double acting hydraulic shock absorbers with three steps adjustable coil springs. The suspension system available in the vehicle is very advanced and provides greater control and stability to the bike. Apart from these, the EagleE DG 70 bike has standard tyres and multi-spoke wheels. No other bike in the class comes with adjustable suspension so far.</p>\r\n<p>The powerful breaking system present in the Eagle DG 70 has greatly increased the controlling and handling of the bike. The 130 mm internal expanding shoe type non-asbestos type brake at the front wheel and 110 mm brake at the rear control the bike when moving in a high speed and helps in decelerating the bike instantly.</p>\r\n<p>The aero-dynamically designed vehicle is available in majestic colors like blue, grey, black and red with a speculated price tag of Rs. 47,000.</p></div>', 'Eagle DG 70 Firebird Price in Pakistan', '', 'publish', 'open', 'open', '', 'eagle-dg-70-firebird-price-in-pakistan', '', '', '2018-04-18 07:28:45', '2018-04-18 07:28:45', '', 0, 'http://bike.qeemat.com/?p=107', 0, 'post', '', 0),
(108, 1, '2018-04-07 10:03:55', '2018-04-07 10:03:55', '<h2>Eagle Firebird DG 70 Review</h2>\r\n								\r\n								<p>The Eagle 70 is a small four stroke motor cycle produced recently by Eagle. Introduced to compete against rival two-stroke small capacity motor cycles, the Eagle DG 70 Firebird is a four-stroke, small capacity motor cycle, with an engine displacement of only 72 cm³. With Eagle’s specialty four-stroke technology, getting extra mileage from every cc that will take you onto the road ahead of everybody. The new eye-catching graphics, comfortable new seat design and its exquisite aero dynamic shape have made it a best choice and a perfect partner, longer better cushioned seat makes the going more comfortable for one up or two up riding!</p> \r\n<p>The newly introduced Eagle DG 70 is very cheap to operate with a typical fuel economy of 40 miles (64 kilometers) in a liter which promises you the most economical ride of your life. A solid, reliable and very practical competitor, this bike offers 50 cc economy with a power of 70 cc vehicle. The tank carries a 10 liters and a petrol reserve capacity of 1 liter too. The vehicles fuel capacity that is one liter more than Honda CD 70 whose tank carries a maximum fuel capacity of 9 liters.</p>\r\n								<p>The Eagle Firebird comes loaded with a 78 cc engine that is air cooled, 4 strokes, and single cylinder, the new improved motor bike produces a top power of 7.0 PS at 6500 rpm and a peak torque of 5.4 nm at 6500 rpm. The splendidly designed vehicle uses a 4 speed gearbox which follows all down gear shifting pattern. It comes with a CDI ignition and handles lock. The starting pattern is kick start only.</p>\r\n<p>The Eagle bike has been equipped with standard brakes and suspension. The motor has double acting hydraulic shock absorbers with three steps adjustable coil springs. The suspension system available in the vehicle is very advanced and provides greater control and stability to the bike. Apart from these, the EagleE DG 70 bike has standard tyres and multi-spoke wheels. No other bike in the class comes with adjustable suspension so far.</p>\r\n<p>The powerful breaking system present in the Eagle DG 70 has greatly increased the controlling and handling of the bike. The 130 mm internal expanding shoe type non-asbestos type brake at the front wheel and 110 mm brake at the rear control the bike when moving in a high speed and helps in decelerating the bike instantly.</p>\r\n<p>The aero-dynamically designed vehicle is available in majestic colors like blue, grey, black and red with a speculated price tag of Rs. 47,000.</p>', 'Eagle DG 70 Firebird Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '107-revision-v1', '', '', '2018-04-07 10:03:55', '2018-04-07 10:03:55', '', 107, 'http://bike.qeemat.com/uncategorized/107-revision-v1.php', 0, 'revision', '', 0),
(109, 1, '2016-08-24 10:10:08', '2016-08-24 10:10:08', '<div class=\"car-fea-info\">\r\n								<p>After Suzuki\'s Power League, another wonderful sports bike has now been introduced to stun the world with its dynamic performance and stylish appearance. Eagle Fire Bolt ES 70 is, therefore, the latest gossip in the world of bikers.</p>\r\n								<h2>78 cc Engine:</h2>\r\n								<p>The bike performs with a 12V engine having a displacement of 78 cc, and giving a mileage of 85 Km/l. The engine has a compression ratio of 9.1: 1. An optimum force of 7 PS (horsepower) at 6500 rmp is generated which equals 5.3 Kilowatts. On the other hand, the motorcycle’s maximum torque is 5.4 NM at 6500 rmp.</p>\r\n<h2>4-Level Transmission System:</h2>\r\n								<p>A four speed transmission—all forward—is what contributes to the fast speed that can be compared to a fire bolt, hence the name. However, majority of the hardcore sports bikers would disagree. The optimum speed of this bike does not hold a candle to the much more superior Suzuki Hayabusa which runs on a far more powerful 1340 cc engine. Eagle Fire Bolt 70 is, therefore, meant for average users and satisfies their mediocre power needs.</p>\r\n								<h2>Exquisite Outlook:</h2>\r\n								<p>The design of the bike is strengthened by a durable steel metal frame. Once again, manufacturers must have kept average bikers in mind before shaping up the beast. Therefore, the style is not wildly sporty. On the other hand, a decent and classic look is maintained, giving the bike slight tweaks for a moderately sporty look. For this reason, it will be easy to handle by even an amateur. Some other sports bikes, such as Suzuki Hayabusa and Intruder have a bedazzling sporty look, but they can’t be handled by just anyone. On the other hand, Eagle’s Fire Bolt reaches out to a much larger audience through its comparatively simpler outlook.</p>\r\n								<h2>Weight and Body Dimensions:</h2>\r\n								<P>Weighing 82 Kg, it is, therefore, light and elegant. It measures 1885 x 760 x 990 mm with a convenient seat height of 760 mm. This seat has been designed with a pleasantly large room for two. Therefore, you and your companion can share an adventure on the road.</P>\r\n								<h2>Road Grip:</h2>\r\n								<p>With the wheel base being 1210 mm and the ground clearance equal to 135 mm, the bike provides sufficient road grip. Since the maximum speed is easily controllable, maintaining a hold on the ground will not be a challenge. Therefore, chances of accidental slips and flipping over are little.</p>\r\n<h2>Safety Measures:</h2>\r\n								<p>The safety is ensured by efficient front and rear drum brakes that stop the vehicle without a jolt. The front 2.25-17-4PR brake has an air pressure equal to 26 lbs per square inch. On the other hand, the rear 2.50-17-4PR brake maintains an air pressure of 32 lbs per square inch.</p>\r\n								<h2>Fuel Capacity:</h2>\r\n								<p>The whooping fuel tank capacity of up to 10.5 liters is enough for long journeys as the engine already consumes the fuel efficiently. So, once the fuel tank is filled to its full capacity, you can easily travel for more than 800 kilometers, that is a fairly long distance.</p>\r\n								<h2>Advanced Digital Speedometer:</h2>\r\n								<p>The calibrated analogue dial for telling you the speed of your bike stands outdated now: here is something new for you! An advanced digital speedometer updates you about your current speed. A digital clock is also available so that you can find out the time at a single glance.</p>\r\n								<h2>Price & Color Options:</h2>\r\n								<p>The Eagle Fire Bolt ES 70 price in Pakistan is slightly over fifty thousand. Red, black and blue are the chic color options for giving a striking look to the bike. Your trendy new partner will definitely earn you a great deal of attention on the road when you cut through the air riding on it.</p>\r\n								<h2>Bottom Line:</h2>\r\n								<p>To sum up, the Eagle\'s marvelous product is a wonderful option for all average bikers who want to upgrade to a more innovative design and technology while still being able to afford the price and handle the power conveniently.</p></div>', 'Eagle Fire Bolt ES70 Price in Pakistan', '', 'publish', 'open', 'open', '', 'eagle-firebolt-es70-price-in-pakistan', '', '', '2018-04-18 07:12:16', '2018-04-18 07:12:16', '', 0, 'http://bike.qeemat.com/?p=109', 0, 'post', '', 0),
