(135, 1, '2017-09-27 10:47:56', '2017-09-27 10:47:56', '<div class=\"car-fea-info\">\r\n<h2>Latest, Most Powerful Addition to Unique Family:</h2>\r\n								<p>The Unique Crazer 150cc bike comes as the latest addition to the Unique family of stylish and user-friendly motorcycles. At the same time, it also happens to be the most powerful bike ever produced at the end of Unique. The Unique UD Xtreme is the least powerful bike with 70cc engine category. UD 100 is a bit more powerful sibling of the Xtreme as it is powered by a 100cc machine.</p>\r\n<p>Moving up the power stair, you will come across the UD 125, an elder bro of the Xtreme. Next comes the turn of Crazer which, equipped with a 150cc engine, emerges as the most powerful member of the Unique family. The Unique motorcycles brand, on the other hand, is ranked among the top ten best-selling Chinese bike brands in the country.</p>\r\n								<h2>Unique’s Unique Specs:</h2>\r\n								<p>A unique bike from the Unique brand, the new Unique Crazer 150cc brings a set of unique characteristics. On the first place, you come across a masculine body with creative curves and curvatures. Meanwhile, the bold and fascinating design gives the hue of international standard. Put in simpler words, it is all set to leave you crazy on the road. At the same time, yet another piece of fascination is that the Unique Crazer 150cc price in Pakistan is quite affordable.</p>\r\n<p>Listed and briefly described below are some of the major features of the bike.</p>\r\n								<h2>Majestic Appearance:</h2>\r\n								<p>The majestic appearance of the new Unique Crazer is what the modern youthful bike enthusiasts are really looking for. The bold, bulky and wavy body dynamics give it a stunning look. So, the very look revs the hearts of the viewers. The fuel tank is exceedingly muscular with parts extending sideways and going forward. The seat, on the other hand, is sufficiently slim and comfortably styled. However, the seat for the pillion rider is significantly raised. The mudguard and the back parts show a remarkable uniqueness. But this is not all – every single part, ranging from the wheel to the engine and the silencer, represents a fresh style.</p>\r\n<p>Here you also need to note that the Crazer proudly offers two awe-inspiring variations for the body color, i.e. sky blue and lush green. However, none of the colors has anything to do with the Unique Crazer 150cc price in Pakistan 2018.</p>\r\n								<h2>Powerful LED Headlight:</h2>\r\n								<p>If you have to undertake night travels, you would definitely know about the importance of a sharp headlight. This sports bike has a plenty of features for long travels especially during the night time. For example, its LED headlight is so powerful and long-reaching. It lights a long way ahead just like the daylight visibility. So, you can confidently drive at higher speeds.</p>\r\n<h2>Digital Meter with LED:</h2>\r\n								<p>The bright and beautiful digital meter offers increased and easy visibility to the rider. You can learn about the driving parameters with the glimpse of your eye. It is also provided with brilliant LED display to further add to your convenience.</p>\r\n<h2>Gigantic Fuel Tank:</h2>\r\n								<p>The fuel tank of the Crazer is not only muscular and expressive in appearance, it is also gigantic in capacity. Though the fuel efficiency is not comparable with that of a Japanese bike brand, like Honda, a larger petrol tank will help you travel longer distances with single refill.</p></div>', 'New Unique Crazer 150 2018 Model Launched in Pakistan - See Specs', '', 'publish', 'open', 'open', '', 'unique-crazer-150cc-price', '', '', '2018-04-17 11:22:26', '2018-04-17 11:22:26', '', 0, 'http://bike.qeemat.com/?p=135', 0, 'post', '', 0),
