(150, 1, '2018-04-07 10:54:49', '2018-04-07 10:54:49', '<h4>SP Archi – It Brings the Power of 150cc Engine:</h4>\r\n								<p>As it is logically understandable, a 150cc engine is more than twice as powerful as a 70cc machine. Obviously, in the Super Power Archi, you will be enjoying over two times as energetic a ride as that of a 70cc motorcycle. And when a machine produces a more forceful thrust, it is capable of running at the faster speeds. And Archi does. It can run at the speed of 100 kilometers per hour. Isn’t it enough for quick travelling and thereby saving you a lot of time? </p>\r\n								<h4>Look and Feel of a Heavy Bike:</h4>\r\n								<p>Here is good news for the aspirants of a heavy bike. Offered against affordable SP 150cc price in Pakistan, the motorcycle offers you not only amazing performance but also brings a bold, muscular body. It looks so sturdy and brave. The creative combination of the black and red colors on different body parts further contributes to the beauty of the beast.</p>\r\n<p>As compared with the traditional heavy bikes, the SP 150cc Archi price is incredibly low and affordable. It is affordable not only in terms of the price but also maintenance and the travelling expenses or fuel expenditure. With the consumption of one liter of petrol, it can travel the distance of 35 to 45 kilometers depending on the factors, like road conditions, number of persons riding and health of the bike, etc.</p>\r\n								<h4>Larger Fuel Tank:</h4>\r\n								<p>The bike already gives you fuel economy. On the other hand, the fuel tank offers great accommodation capacity of 15 liters. What does it mean for the individuals to use the motorcycle for long intercity travels. Obviously, they will be enjoying a perfect peace of mind as the single refill is enough to take them several hundred kilometers. In fact, they can take a round trip between two cities.</p>\r\n<h4>Quick & Easy Starting:</h4>\r\n								<p>Who is there to refuse to enjoy the comfort a heavy bike offers? You won’t find one around. With the modern self-starter system of SP 150cc, you can easily avoid the hassle of kick-starting. When you are with a pillion rider, it will save you from the embarrassment of striking the kick lever time and again to start the bike. In case the engine of your bike gets shut off on a road with heavy traffic, you will be able to restart the bike in a few seconds.</p>\r\n								<P>What would you do if the self-starter system goes out of order and you are unable to get it right with a DIY (Do It Yourself) attempt? Another option is there at your very disposal – the traditional kick-starter system. In other words, in case of the failure of the automatic starter system, you can get help of the kick-starting mechanism to put the bike on road. </P>\r\n								<p>Summing up, Super Power’s new SP 150cc Archi is an ideal bike for the low-income individuals aspiring to enjoy a ride on a bike that sounds and performs like a heavy bike. You can also confidently use it for commuting.</p>\r\n', 'Power ARCHI 150 Price - 2017-2018 in Pakistan', '', 'inherit', 'closed', 'closed', '', '149-revision-v1', '', '', '2018-04-07 10:54:49', '2018-04-07 10:54:49', '', 149, 'http://bike.qeemat.com/uncategorized/149-revision-v1.php', 0, 'revision', '', 0),
