(182, 1, '2018-04-07 11:19:46', '2018-04-07 11:19:46', '<h2>Treet TR-100 Review</h2>\r\n								<h4>Unique Blend of Style and Power:</h4>\r\n								<p>“Style and power” is what defines the taste of the modern bike lovers and the unique blending of design and energy, as witnessed in new Treet TR-100, will render some extra appeal to this two wheeler. Just like its 70 cc counterpart, the 100 cc is also available in two sharp & shining red and black shades and you can go for either of these according to your own taste. So, if you love energy, strength, power and passion, just go for the emotionally intense red color. On the other hand, if you are a lover of mystery, wealth, power and sophistication, the black shade is at your very disposal. On the other hand, the 4 stroke engine with the displacement of 100cc will generate enough thrust for an energetic drive on the highway as well as congested city roads.</p>\r\n<h4>Large Fuel Tank & Continuous 4-Speed Mesh Transmission:</h4>\r\n								<p>The fuel tank capacity of your bike matters a lot especially when you plan to go on a long drive with thinly placed filling stations on the way. Keeping this point in view, the manufacturers at the house of Treet have installed a large fuel tank on the TR-100 bike that can accommodate nearly 10 liters of petrol, so that you can easily go for hundreds of miles without having to visit the filling station. The continuous 4-speed Mesh Transmission System is renowned for its efficient fuel distribution. In this way, you will smoothly be switching from the lower to higher or higher to lower level of speed and torque while on the go. However, there is no automatic ignition mechanism and you will have to go for the traditional ‘kick start’ system for starting the motorbike.</p>\r\n								<h4>Comfortable Seating and Stable Drive:</h4>\r\n								<p>Placed at a standard height of 798 mm from the ground, the seat is meant for two persons and is built with a soft, durable material and modern design. Both the driver and a pillion rider will enjoy a comfortable ride on long routes and would be facing least tiredness on otherwise tiring and troublesome journeys. The ground clearance of 156 mm is a sign of the stability of the drive on the smooth roads and somewhat uneven terrains. It is enough to keep the bike firm on the ground while moving steadily without creating the unwanted and painful situations, like jerks.</p>\r\n								<h4>Additional Accomplishments:</h4>\r\n								<p>Apart from the above mentioned appealing specification standards, you also have some additional features, such as Swing Arm Travel 84 mm back suspension system and the Telescopic Fork Travel 9.4 mm front transmission system. Such accomplishments will ensure that your bike’s tires remain in constant contact with the ground for a better grip, thus giving you smooth travel over bumps in the road by absorbing and dissipating the kinetic energy from the point of contact. Unlike the case with the TR-70, where both the tires were 4 ply, there is a 6 ply (3.0-17 6 PR) tire on the back of the bike. With this enhancement, you will be in a position to carry heavy loads and a bulky pillion rider quite easily.</p>\r\n								<h4>Summing Up:</h4>\r\n								<p>After having discovered the pros and cons and Treet TR-100 price in Pakistan, you would now be in a better position to make a favorable decision regarding the purchase of the motorcycle. The dimensions of 1986, 718 and 1050 mm also support its power and performance. In short, whether you buy Treet TR-100 motorbike or not, one thing is for sure that this powerful road runner is worth appreciating for its advanced specs.</p>', 'Treet TR-100 Motorcycle Price with Pictures', '', 'inherit', 'closed', 'closed', '', '174-revision-v1', '', '', '2018-04-07 11:19:46', '2018-04-07 11:19:46', '', 174, 'http://bike.qeemat.com/uncategorized/174-revision-v1.php', 0, 'revision', '', 0),
(781, 1, '2018-04-18 06:54:53', '2018-04-18 06:54:53', '<div class=\"car-fea-info\">\r\n<h2>New United 100 CC:</h2>								\r\n	<p>Though somewhat dangerous on busy roads in the congested urban areas, motorcycle is a relatively cheaper means of transportation that is also accessible to all and sundry. Not only the price of a standard motorbike is within the reach of a low income individual, but also its maintenance and fuel expenditures are not as much higher as those of a car or other larger and expensive vehicles. However, to choose a better quality bike from a collection of competing brands in the market, you need to keep certain things in mind. Recently, the “United Auto Industries Limited” has emerged with a new 100cc bike that is catching the attention of the potential buyers, particularly because of high United 100cc Motorcycle specifications and easy affordability. Before you finally make your mind to go for it, just go through the following review so that you might be aware of its pros and cons:</p>\r\n<h2>4-Stroke Air-Cooled OHC Engine:</h2>\r\n		<p>The easily affordable United 100cc motorcycle price in Pakistan (about 50,000 pak rupees) doesn’t mean that you will have to compromise for extra powerful features as found in the competing brands in the market. To your great amazement, this unbelievably inexpensive two-wheeler is packed with an advanced 4 stroke engine which, though a single cylinder machine, comes with air cooling mechanism and the latest OHC (Over-Head Camshaft) technology which works in a more direct manner compared to the overhead valves (OHV) and pushrods. It will generate enough power to keep your vehicle running energetically and smoothly even on the bumpy and uneven roads as is the case in backward areas of Pakistan. Moreover, even in the scorching heat of summer with extremely high environmental temperatures, your vehicle will not get overheated as the improved air cooling mechanism will serve to keep the engine cooled with the help of the fast flow of air striking against its head.</p>\r\n								\r\n	<h2>Great Look and Comfortable Ride:</h2>\r\n								<p>Among other things, the design and outlook of a bike have got great importance and influence the decision making process of the potential buyers. As you can view from the United 100cc motorcycle pictures, its streamline design and enhanced aerodynamics minimize the friction and resistance offered by the air from ahead. As a consequence, you’ll be traversing the harsh terrain with fleeting speeds while cutting through the pool of air. Not just this, but it will also give you a well balanced, stable and comfortable ride, so that you do not get tired on otherwise long & tiresome journeys.</p>\r\n		<h2>4-Speed Transmission & Wet Multiplate Clutch:</h2>\r\n								<p>Contributing to the comfort of travelling and ease of driving, the vehicle is powered with a 4-speed transmission system. In this way the combustion system will work at its utmost with the efficient and evenly distributed fuel supply. Meanwhile, the wet multiplate type 4 clutch system is to ensure convenient and trouble-free shifting of gears whenever required. So, the machine will switch on to the next transmission level without causing a bit of noise, and the possibility for the gear to get stuck up is also eliminated.</p>\r\n	<h2>Summing Up:</h2>\r\n								<p>To sum up, the present 100cc motorbike, from the house of United Auto Industries, is undoubtedly one of the best two-wheeler available in the country that comes with the special advantage of extremely affordable package. So, if you want to enjoy a powerful and luxurious ride while remaining within the limits posed by your economic circumstances, it will convert your dream into reality. Besides being fuel-efficient, it contains a large fuel tank that can accommodate as many as 10 liters of fuel, thus enabling you go for hundreds of miles without visiting the filling station.</p></div>', 'United 100cc Motorcycle Price in Pakistan - New Model Pictures', '', 'inherit', 'closed', 'closed', '', '186-revision-v1', '', '', '2018-04-18 06:54:53', '2018-04-18 06:54:53', '', 186, 'http://bike.qeemat.com/uncategorized/186-revision-v1.php', 0, 'revision', '', 0),
