(191, 1, '2016-05-05 12:03:44', '2016-05-05 12:03:44', '<div class=\"car-fea-info\">								\r\n								<p>Pak Suzuki Motor Co. Ltd. has launched “Raider” (“New Raider 110”, “Suzuki Raider”) the new and completely remodeled Suzuki motor cycle in August, 2012 all over Pakistan. The introductory price is RS. 83,400 and availability is in all major regions of Pakistan, visit your near dealer. With its new launch, Pak Suzuki has given an offer to exchange your old Suzuki bike with new raider 110 for a little changeover price. Pak Suzuki Motor Co. Ltd. claims that new launch will give the experience of riding 100CC power at a mileage of 70CC bike.</p>\r\n						\r\n								<p>Intrigued, we thought of going for a little test drive and guess what, this vehicle happened to make an impression on us, which we did not expect, from Suzuki.</p> \r\n						\r\n								<p>Suzuki Raider has come in compliant with “Euro II” technology. The two-wheeler is loaded with powerful 110CC fuel efficient engine with 4-stroke single cylinder and 4-gear transmission. Sporty look and design, crystal head light and back lamp and new speedometer with gear indicator add style and richness to the bike. Raider motor cycle is available in two colors, red and black.</p>\r\n<h2>Performance:</h2>\r\n								<p>With all new “Euro II” technology and 110cc 4-stroke engine, raider is economical in fuel consumption yet fast speed and powerful motor bike. Bikers enjoy the power of 110cc engine at a fuel consumption of 70CC engine. Compared to what we get from a 70CC bike, the feel of energy and the sense of power on this motor bike are matchless. And the fuel economy in terms of engine power is great. With its launch in Pakistan, raider is getting popularity of young and enthusiastic bikers. Comparing price with performance the experience is more than expected.</p>\r\n<h2>Design and Look:</h2>\r\n								<p>Raider is designed according to modern trends of biking. It is sporty in look and incites the interest of young bikers. The new two-wheeler comes with all-new speedometer with twin meter panel. The panel is distributed among speed and gear indicator. Crystal lights and colored fender adds further beauty of the vehicle. Suzuki raider gives a comfortable ride with better suspension and wider and longer seating space.</p>\r\n<h2>Resale and Maintenance:</h2>\r\n								<p>Since raider is new to market and looking at feedback and popularity, it can be determined that resale will not be a risk. Maintenance of bike is also easy and risk-free since Suzuki authorized dealers and workshops are located at different parts of the country. With respect to price, performance and resale, Raider is greater in value.</p>\r\n								</div>', 'Suzuki Raider Price, Pictures of New Model in Pakistan - Bikes', '', 'publish', 'open', 'open', '', 'suzuki-raider-price-in-pakistan', '', '', '2018-04-17 07:28:11', '2018-04-17 07:28:11', '', 0, 'http://bike.qeemat.com/?p=191', 0, 'post', '', 0),
