(211, 1, '2018-04-08 06:30:16', '2018-04-08 06:30:16', '<div class=\"car-fea-info\">\r\n<h2>Latest, Most Powerful Addition to Unique Family:</h2>\r\n								<p>The Unique Crazer 150cc bike comes as the latest addition to the Unique family of stylish and user-friendly motorcycles. At the same time, it also happens to be the most powerful bike ever produced at the end of Unique. The Unique UD Xtreme is the least powerful bike with 70cc engine category. UD 100 is a bit more powerful sibling of the Xtreme as it is powered by a 100cc machine.</p>\r\n<p>Moving up the power stair, you will come across the UD 125, an elder bro of the Xtreme. Next comes the turn of Crazer which, equipped with a 150cc engine, emerges as the most powerful member of the Unique family. The Unique motorcycles brand, on the other hand, is ranked among the top ten best-selling Chinese bike brands in the country.</p>\r\n								<h2>Unique’s Unique Specs:</h2>\r\n								<p>A unique bike from the Unique brand, the new Unique Crazer 150cc brings a set of unique characteristics. On the first place, you come across a masculine body with creative curves and curvatures. Meanwhile, the bold and fascinating design gives the hue of international standard. Put in simpler words, it is all set to leave you crazy on the road. At the same time, yet another piece of fascination is that the Unique Crazer 150cc price in Pakistan is quite affordable.</p>\r\n<p>Listed and briefly described below are some of the major features of the bike.</p>\r\n								<h2>Majestic Appearance:</h2>\r\n								<p>The majestic appearance of the new Unique Crazer is what the modern youthful bike enthusiasts are really looking for. The bold, bulky and wavy body dynamics give it a stunning look. So, the very look revs the hearts of the viewers. The fuel tank is exceedingly muscular with parts extending sideways and going forward. The seat, on the other hand, is sufficiently slim and comfortably styled. However, the seat for the pillion rider is significantly raised. The mudguard and the back parts show a remarkable uniqueness. But this is not all – every single part, ranging from the wheel to the engine and the silencer, represents a fresh style.</p>\r\n<p>Here you also need to note that the Crazer proudly offers two awe-inspiring variations for the body color, i.e. sky blue and lush green. However, none of the colors has anything to do with the Unique Crazer 150cc price in Pakistan 2018.</p>\r\n								<h2>Powerful LED Headlight:</h2>\r\n								<p>If you have to undertake night travels, you would definitely know about the importance of a sharp headlight. This sports bike has a plenty of features for long travels especially during the night time. For example, its LED headlight is so powerful and long-reaching. It lights a long way ahead just like the daylight visibility. So, you can confidently drive at higher speeds.</p>\r\n<h2>Digital Meter with LED:</h2>\r\n								<p>The bright and beautiful digital meter offers increased and easy visibility to the rider. You can learn about the driving parameters with the glimpse of your eye. It is also provided with brilliant LED display to further add to your convenience.</p>\r\n<h2>Gigantic Fuel Tank:</h2>\r\n								<p>The fuel tank of the Crazer is not only muscular and expressive in appearance, it is also gigantic in capacity. Though the fuel efficiency is not comparable with that of a Japanese bike brand, like Honda, a larger petrol tank will help you travel longer distances with single refill.</p>', 'New Unique Crazer 150 2018 Model Launched in Pakistan - See Specs', '', 'inherit', 'closed', 'closed', '', '135-revision-v1', '', '', '2018-04-08 06:30:16', '2018-04-08 06:30:16', '', 135, 'http://bike.qeemat.com/uncategorized/135-revision-v1.php', 0, 'revision', '', 0),
(203, 1, '2018-04-08 06:17:43', '2018-04-08 06:17:43', '<div class=\"car-fea-info\">\r\n<h2>Treet TR-70 Review</h2>\r\n								<h4>A Word about Treet:</h4>\r\n								<p>Founded in 1954, the Treet Corporation Limited is an internationally famous manufacturer of razors, blades and other products. The company is based in Pakistan and exports its products to over 35 countries in the world. The Global Econo Trade (Private) Limited, a semi-autonomous unit under the umbrella of TGC (Treet Group of Companies) is tasked with assembling, sales and marketing of Treet Bikes. The peculiarity about the Treet Bikes is that they are not merely highly fuel efficient but also come with eco friendly features and give you a comfortable drive no matter whatever road conditions you are driving on. For the time being, the company is manufacturing 70cc bikes, 100cc bikes as well as three wheelers, all of which have attracted the attention of the potential buyers.</p>\r\n<h4>Euro II in the New Treet TR-70:</h4>\r\n								<p>Among all the 70cc bikes, from the house of Treet, the TR-70 is the only model that comes with the latest Euro II technology. So, complying with the advanced European emission standards, the bike will cause least pollution in the already polluted environment of your country as well as cover more distance in less fuel. In this way, you can contribute to the global efforts for preserving the natural environment not only for yourself but also for the generations to come.</p>\r\n								<h4>Magnificent Body Shades:</h4>\r\n								<p>Black and red are the most common colors for bikes, but sometimes new motorcycles from the world famous brands come only with a single color option. A single color option is usually considered to be a drawback, because people fond of red color would find it difficult to go for black and the same is true for the black shade lovers. Fortunately, you can buy Treet RT-70 Euro II not just in red but also in black body color. Both the shades are sharp and brilliant, thus fascinating the onlookers at the very first sight.</p>\r\n								<h4>4-Stroke OHV Air-Cooled Engine:</h4>\r\n								<p>If you intend to buy a motorbike for family usage, it will be wise to go for the one powered with 4 stroke engine instead of an ordinary 2 stroke machine. The more powerful engine will give a smooth, stable and energetic drive on the topsy-turvy, bumpy and uneven road conditions as is the case with backward areas in the country. In addition, it will also be convenient to transport load and carry a pillion rider even on long drives. The built-in air-cooling mechanism will serve to keep the engine cool and avoid its overheating, and such an amazing accomplishment will be of great utility on the longer drives in the sizzling heat of summer.</p>\r\n<h4>Brake & Suspension Systems:</h4>\r\n								<p>Road safety is probably one of the first things that are to be ensured while manufacturing a vehicle, because it is the life of a human being that is the most expensive thing in the world. The safety measures become even more important when you are going to build a relatively insecure two wheeler. However, if you are going to possess this new bike, in exchange for reasonable Treet TR-70 Euro II price in Pakistan, there is no need to worry a bit. It already contains an efficient and quick responding Drum Brake system for the front and rare wheels. Similarly, the back and front suspensions systems are also satisfactory and yield very good results. The back suspension is furnished with Spiral Spring while the front suspension is assisted by Center Axle from 277 tubes.</p>\r\n								<h4>Summing Up:</h4>\r\n								<p>Like other famous products, manufactured by the Treet Corporation Limited, this powerful motorbike with high Treet TR-70 Euro II specifications is destined to be reliable and come up to the expectations of the clients. From above, its attractive, streamlined and speed-friendly design emanates an air of confidence and sophistication while, from within, the advanced Euro II engine technology and other features will render extreme level of drive efficiency and fuel economy.</p>', 'Treet TR70 Price in Pakistan - New Motorcycle Making Company', '', 'inherit', 'closed', 'closed', '', '184-revision-v1', '', '', '2018-04-08 06:17:43', '2018-04-08 06:17:43', '', 184, 'http://bike.qeemat.com/uncategorized/184-revision-v1.php', 0, 'revision', '', 0),
(775, 1, '2018-04-18 06:48:18', '2018-04-18 06:48:18', '', 'Treet TR70 Black', '', 'inherit', 'open', 'closed', '', 'treet-tr-70-black', '', '', '2018-04-18 06:48:44', '2018-04-18 06:48:44', '', 184, 'http://bike.qeemat.com/wp-content/uploads/2018/04/treet-tr-70-black.jpg', 0, 'attachment', 'image/jpeg', 0),
(204, 1, '2018-04-08 06:18:31', '2018-04-08 06:18:31', '<div class=\"car-fea-info\">\r\n<h2>Treet TR-100 Review</h2>\r\n								<h4>Unique Blend of Style and Power:</h4>\r\n								<p>“Style and power” is what defines the taste of the modern bike lovers and the unique blending of design and energy, as witnessed in new Treet TR-100, will render some extra appeal to this two wheeler. Just like its 70 cc counterpart, the 100 cc is also available in two sharp & shining red and black shades and you can go for either of these according to your own taste. So, if you love energy, strength, power and passion, just go for the emotionally intense red color. On the other hand, if you are a lover of mystery, wealth, power and sophistication, the black shade is at your very disposal. On the other hand, the 4 stroke engine with the displacement of 100cc will generate enough thrust for an energetic drive on the highway as well as congested city roads.</p>\r\n<h4>Large Fuel Tank & Continuous 4-Speed Mesh Transmission:</h4>\r\n								<p>The fuel tank capacity of your bike matters a lot especially when you plan to go on a long drive with thinly placed filling stations on the way. Keeping this point in view, the manufacturers at the house of Treet have installed a large fuel tank on the TR-100 bike that can accommodate nearly 10 liters of petrol, so that you can easily go for hundreds of miles without having to visit the filling station. The continuous 4-speed Mesh Transmission System is renowned for its efficient fuel distribution. In this way, you will smoothly be switching from the lower to higher or higher to lower level of speed and torque while on the go. However, there is no automatic ignition mechanism and you will have to go for the traditional ‘kick start’ system for starting the motorbike.</p>\r\n								<h4>Comfortable Seating and Stable Drive:</h4>\r\n								<p>Placed at a standard height of 798 mm from the ground, the seat is meant for two persons and is built with a soft, durable material and modern design. Both the driver and a pillion rider will enjoy a comfortable ride on long routes and would be facing least tiredness on otherwise tiring and troublesome journeys. The ground clearance of 156 mm is a sign of the stability of the drive on the smooth roads and somewhat uneven terrains. It is enough to keep the bike firm on the ground while moving steadily without creating the unwanted and painful situations, like jerks.</p>\r\n								<h4>Additional Accomplishments:</h4>\r\n								<p>Apart from the above mentioned appealing specification standards, you also have some additional features, such as Swing Arm Travel 84 mm back suspension system and the Telescopic Fork Travel 9.4 mm front transmission system. Such accomplishments will ensure that your bike’s tires remain in constant contact with the ground for a better grip, thus giving you smooth travel over bumps in the road by absorbing and dissipating the kinetic energy from the point of contact. Unlike the case with the TR-70, where both the tires were 4 ply, there is a 6 ply (3.0-17 6 PR) tire on the back of the bike. With this enhancement, you will be in a position to carry heavy loads and a bulky pillion rider quite easily.</p>\r\n								<h4>Summing Up:</h4>\r\n								<p>After having discovered the pros and cons and Treet TR-100 price in Pakistan, you would now be in a better position to make a favorable decision regarding the purchase of the motorcycle. The dimensions of 1986, 718 and 1050 mm also support its power and performance. In short, whether you buy Treet TR-100 motorbike or not, one thing is for sure that this powerful road runner is worth appreciating for its advanced specs.</p>', 'Treet TR-100 Motorcycle Price with Pictures', '', 'inherit', 'closed', 'closed', '', '174-revision-v1', '', '', '2018-04-08 06:18:31', '2018-04-08 06:18:31', '', 174, 'http://bike.qeemat.com/uncategorized/174-revision-v1.php', 0, 'revision', '', 0),
(205, 1, '2018-04-08 06:19:34', '2018-04-08 06:19:34', '<div class=\"car-fea-info\">\r\n<h2>Road Prince RP 70 Review</h2>\r\n								<p>With the help of trained work force that is specialized in making best technological bikes, Road Prince feels proud in announcing its real companion RP-70CC bike for you. Road Prince is undoubtedly an amalgamation of latest aerodynamic designs and super economy-power to provide you a smooth journey on the curvy roads. This bike truly meets the basic standards of quality and durability, which is the real demand of users to own it. You will find so many Road Prince competitors in the market, thereby, you can compare Road Prince RP-70CC price in Pakistan, and the price tags of this company are real sensational and affordable.</p>\r\n<p>Defining it features, you will find its body equipped with beautiful and fascinating designs. It will give you a feel of comfort while riding on this spacious and physically powerful seat. The suspension system is amazing and flexible. You backbone will never get affected while riding on it. The powerful shock observers in the bike are capable of tolerating the bumps and jerks on the road. Moreover, the four-stroke engine is designed with state-of-the-art technology. The engineers have put their best efforts to mingle the Japanese technology in this engine with innovation and expertise to produce the stylish and well-groomed motorcycle for all Pakistanis. The bike is offered in black and red colors. Road prince motorcycle will never deceive you with its performance unless and until you take care of it.</p>\r\n', 'Road Prince Motorcycle Price in Pakistan | 2016 RP70 Bike', '', 'inherit', 'closed', 'closed', '', '170-revision-v1', '', '', '2018-04-08 06:19:34', '2018-04-08 06:19:34', '', 170, 'http://bike.qeemat.com/uncategorized/170-revision-v1.php', 0, 'revision', '', 0),
(206, 1, '2018-04-08 06:20:03', '2018-04-08 06:20:03', '<div class=\"car-fea-info\">\r\n<h2>Road Prince WeGo 150cc Review</h2>\r\n								<h4>Road Prince – Place in Market:</h4>\r\n								<p>Road Prince is a brand of motor bikes and rickshaws that has rapidly rose to prominence in the country on account of style, affordability, energy efficiency and power. With the passage of time, the resale value of this particular brand of bikes and rickshaws has also increased.</p>\r\n								<p>It cannot, however, be compared with the resale value of Honda which sells like hot cakes even after years of its usage. In fact, the Honda motorbike brand is considered as the best particularly owing to its long life, convenient handling and better fuel economy.</p>\r\n<p>Road Prince bikes are manufactured by Omega Industries that emerged on the scene of auto industry in the year 1995. On the basis of quality and reliability of products, it is ranked among the top motorcycle manufacturers in the country. The company has a country-wide network for facilitating the customers in sales, services and spare parts.</p>\r\n								\r\n								<h4>Wego Red & Black Beasts:</h4>\r\n								<p>Against a considerably high Road Prince Wego 150 price in Pakistan, this powerful bike offers two color choices for body to the potential buyers. That is, you can go for either the red beast or the black beast. Both the versions have so sleek and stylish appearances. Here it won’t be wrong to claim that each of the color variants of this powerful beast present a perfect blend of style and sophistication.</p>\r\n								<p>If the taste of buyers is inclined towards importance, seriousness and an air of mystery, they can buy the black beast. On the other hand, if their nature loves passion, energy and action, the red beast will best serve to their taste.</p>\r\n								<h4>Bigger in Power, Capacity & Economy:</h4>\r\n								<p>The 149cc cubic capacity of the engine refers to the fact that Wego 150 is a pack of power, energy and action. It will serve to your taste for passion and boldness. You will find it bigger not only power but also fuel accommodation capacity and economy.</p>\r\n								<p>The fuel tank can accommodate as much as 18 liters of petrol. It means you can cover the distance of hundreds of kilometers with single refilling. The fuel economy, on the other hand, is also just according to your expectations.</p>\r\n								<p>Built with the advanced Euro 3 emission standards, Wego is bound to consume significantly less fuel in order to minimize harmful emissions into the environment.</p>\r\n	<h4>Electric Starter and 5-Speed Gearbox:</h4>\r\n								<p>The electric starter system is a better alternative to the traditional kick start mechanism. It not only eliminates the need for physical labor but also starts the bike so quickly and conveniently. You just need to turn the key in ignition switch.</p>\r\n								<p>Generally, the motorbikes have 4-speed gear system. On the other hand, against justifiably high Wego 150 price in Pakistan, this technologically advanced two-wheeler has a gearbox with 5-speed gear system. It means you will be having a smoother and more comfortable and stable drive over all types of road conditions.</p>\r\n								<h4>Bottom Line:</h4>\r\n								<p>Wego 150 comes as one of the best two-wheelers from the house of Omega Industries. No doubt, the price tag attached to it reads unexpectedly high but this is justifiable on account of the powerful specs standards. On the basis of a powerful engine, it rightly deserves the title of a road beast. The choice of red and black colors for the body will contribute to its sales in the country.</p>\r\n', 'Road Prince WeGo 150cc Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '165-revision-v1', '', '', '2018-04-08 06:20:03', '2018-04-08 06:20:03', '', 165, 'http://bike.qeemat.com/uncategorized/165-revision-v1.php', 0, 'revision', '', 0),
(207, 1, '2018-04-08 06:20:29', '2018-04-08 06:20:29', '<div class=\"car-fea-info\">\r\n<h2>Road Prince Passion 70cc Review</h2>\r\n								<h4>The Style – Worth Loving:</h4>\r\n								<p>The Omega Industries motorbike manufactures deserve praise for their aesthetic sense in styling the two-wheelers. It seems a bit enhanced in the Road Prince Passion 70 which is a bike with bold and decent looks. The person having a ride on it feels a sense of pride.</p>\r\n								<p>The technologically-inspired styling of the bike improves its aerodynamics. As a result, it will encounter less air friction while on the way. Less friction means you will have a smooth and stable drive. The same feature will help the motorbike get higher speed in less time.</p>\r\n<p>The careful choice of colors for the body makes a significant contribution in improving the beauty and attractiveness. The colors are so sharp and render a great contrast to different parts of bike. The grey and green designs appear against the pinkish background.</p>\r\n								<p>All these features enable the bike to catch the attention of viewers on the very first sight. The critics are right in their opinion that the style is worth loving.</p>\r\n	<h4>Black & Red Color Variants:</h4>\r\n								<p>Just like <a href=\"http://bike.qeemat.com/china/road-prince-wego-150-price.php\" title=\"Road Prince WeGo 150cc\">Wego 150</a>, the Road Prince Passion 70 is available in the black and red variants for the body color. Each has its own grace and grandeur. The red hue will serve to the taste of those who are the lovers of energy and action.</p>\r\n								<p>On the other hand, the people with likeness for mystery and importance would go for the black version. However, the seat has been kept pitch black in both the variants. The green and grey strips appear in both the versions. You should also note that these additional designing strips offer less contrast against the black shade as comparted with that of red.</p>\r\n								<h4>It Gives a Powerful Drive:</h4>\r\n								<p>The power and potential of Passion 70 cannot be compared with that of Wego 150 which is more than twice energetic. As a result, the Road Prince Passion 70 price in Pakistan is so less and affordable. In fact, it is not even half as much as that of Wego 150.</p>\r\n								<p>The use of advanced technology makes the 70 cc machine generate enough thrust to ensure a powerful drive over all the terrains. According to the analysts and critics of automobile market, the 70cc Road Prince is more powerful than the Honda’s bike with same displacement (i.e. 70cc).</p>\r\n								<p>The price of Honda 70, on the other hand, is significantly high. So Passion 70 stands the winner in terms of affordability. However, if you want a more stable drive and greater resale value, Honda 70 must be your first choice.</p>\r\n								<h4>Greater Petrol Capacity:</h4>\r\n								<p>In comparison with Honda’s <a href=\"http://bike.qeemat.com/honda/honda-cd70-2016-price-in-pakistan.php\" title=\"Honda CD 70\">CD 70</a>, Road Prince’s Passion 70 contains a larger fuel tank. More precisely, the fuel tank capacity of the former measures 8.5 liter while that of latter can accommodate as much as 10.5 liters of petrol.</p>\r\n								<p>So, the individuals who have to go for a long drive on daily basis would definitely like to buy Passion 70. Here, with a single refill, you can go for hundreds of kilometers without worrying about the petrol getting finished on the way.</p>\r\n								<h4>Summing Up:</h4>\r\n								<p>As the very name suggests, against reasonable Road Prince Passion 70 price in Pakistan, the bike has become the best choice for the individuals who are fond of passion and power. The motorbike is not only very economical but also full of style, energy and action. This is what the people with low income look for.</p>', 'New Model of Road Prince 70 - New Design Pictures &amp; Price', '', 'inherit', 'closed', 'closed', '', '159-revision-v1', '', '', '2018-04-08 06:20:29', '2018-04-08 06:20:29', '', 159, 'http://bike.qeemat.com/uncategorized/159-revision-v1.php', 0, 'revision', '', 0);
