(208, 1, '2018-04-08 06:20:53', '2018-04-08 06:20:53', '<div class=\"car-fea-info\">\r\n<h2>Road Prince Bullet Digital 70 Review</h2>\r\n								<h4>Bullet Digital – An Aerodynamic Princely Stature:</h4>\r\n								<p>The Bullet Digital 70 is probably one of the most beautifully styled bikes in Pakistan that has got a graceful look and princely stature. Even while having a maiden ride on it, you will get an air of confidence. The innovative curves serve as a proof of the laudable craftsmanship of the engineers at the house of Omega Industries.</p>\r\n<p>However, you’ll not find a significant addition to its height or overall size. In this respect, it looks almost the same as other Chinese and Japanese bikes with the same engine power. What has mainly been improved is the working and performance on the road.</p>\r\n								\r\n								<h4>Significance of Name:</h4>\r\n								<p>Do you know why this model of Road Prince includes the word “Bullet” in its name? Obviously, it the speed of the bike. The aerodynamic design makes the motorcycle go as fast as a bullet. It means you can cover longer distances in shorter time durations. Thus you can easily save a lot of your precious time.</p>\r\n								<p>Here the buyers also need to note that the fast speed of the bike is not to be achieved at the cost of high fuel consumption. But, in fact, the advanced technological features render it better fuel economy. This is what you really need in the scenario of shrinking income and rising inflation.</p>\r\n								<h4>Power & Performance:</h4>\r\n								<p>Though a low cost bike of Chinese origin, the Bullet Digital 70 gives you excellent performance which is a common characteristic of the Japanese motorbike brands. The 4-stroke OHC engine generates the force enough to give a smooth and stable ride even under unfavorable environmental conditions. It uses the air cooling mechanism to avoid overheating of the machine.</p>\r\n								<p>The engine capacity measures 72 cm3 in its displacement. In other bikes, on the other hand, it may not be more than 68 or 69 cm3. This somewhat increase in the displacement will contribute to the force and speed of the bike. For transmission, there is continuous 4 speed mesh mechanism – the same as found in bike brands from the rival companies.</p>\r\n<h4>Petrol Capacity:</h4>\r\n								<p>While buying a bike, the potential buyers also look for the capacity of the fuel tank for accommodating petrol. This factor will be important especially for the individuals who have to travel long distances on daily basis. The Road Prince Bullet Digital 70 price in Pakistan is almost half as much as that of Honda. Against such an amazing affordability, the bike gives the same petrol capacity as that of Honda’s CD 70 model. Though not extraordinary, 8.5 liter volume is sufficient to support hundreds of kilometers of ride with single refill.</p>\r\n								<h4>Summing Up:</h4>\r\n								<p>The backbone-like, aerodynamic curvature of the body, high power generation, great fuel economy and inspiring performance make Bullet Digital 70 one of the best motorbikes of the Chinese origin in Pakistan. It is assembled and marketed in Pakistan by Omega Industries – a manufacturer of bikes and rickshaws in the country. The word ‘bullet’ in the name of the motorcycle signifies its high speed. The Road Prince Bullet Digital 70 price in Pakistan is incredibly low and affordable. This is yet another attractive aspect of the two-wheeler that will add to its sales.</p>', 'Road Prince Bullet Digital 70 Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '154-revision-v1', '', '', '2018-04-08 06:20:53', '2018-04-08 06:20:53', '', 154, 'http://bike.qeemat.com/uncategorized/154-revision-v1.php', 0, 'revision', '', 0),
(210, 1, '2018-04-08 06:23:22', '2018-04-08 06:23:22', '<div class=\"car-fea-info\">\r\n<h4>SP Archi – It Brings the Power of 150cc Engine:</h4>\r\n								<p>As it is logically understandable, a 150cc engine is more than twice as powerful as a 70cc machine. Obviously, in the Super Power Archi, you will be enjoying over two times as energetic a ride as that of a 70cc motorcycle. And when a machine produces a more forceful thrust, it is capable of running at the faster speeds. And Archi does. It can run at the speed of 100 kilometers per hour. Isn’t it enough for quick travelling and thereby saving you a lot of time? </p>\r\n								<h4>Look and Feel of a Heavy Bike:</h4>\r\n								<p>Here is good news for the aspirants of a heavy bike. Offered against affordable SP 150cc price in Pakistan, the motorcycle offers you not only amazing performance but also brings a bold, muscular body. It looks so sturdy and brave. The creative combination of the black and red colors on different body parts further contributes to the beauty of the beast.</p>\r\n<p>As compared with the traditional heavy bikes, the SP 150cc Archi price is incredibly low and affordable. It is affordable not only in terms of the price but also maintenance and the travelling expenses or fuel expenditure. With the consumption of one liter of petrol, it can travel the distance of 35 to 45 kilometers depending on the factors, like road conditions, number of persons riding and health of the bike, etc.</p>\r\n								<h4>Larger Fuel Tank:</h4>\r\n								<p>The bike already gives you fuel economy. On the other hand, the fuel tank offers great accommodation capacity of 15 liters. What does it mean for the individuals to use the motorcycle for long intercity travels. Obviously, they will be enjoying a perfect peace of mind as the single refill is enough to take them several hundred kilometers. In fact, they can take a round trip between two cities.</p>\r\n<h4>Quick & Easy Starting:</h4>\r\n								<p>Who is there to refuse to enjoy the comfort a heavy bike offers? You won’t find one around. With the modern self-starter system of SP 150cc, you can easily avoid the hassle of kick-starting. When you are with a pillion rider, it will save you from the embarrassment of striking the kick lever time and again to start the bike. In case the engine of your bike gets shut off on a road with heavy traffic, you will be able to restart the bike in a few seconds.</p>\r\n								<P>What would you do if the self-starter system goes out of order and you are unable to get it right with a DIY (Do It Yourself) attempt? Another option is there at your very disposal – the traditional kick-starter system. In other words, in case of the failure of the automatic starter system, you can get help of the kick-starting mechanism to put the bike on road. </P>\r\n								<p>Summing up, Super Power’s new SP 150cc Archi is an ideal bike for the low-income individuals aspiring to enjoy a ride on a bike that sounds and performs like a heavy bike. You can also confidently use it for commuting.</p>\r\n', 'Power ARCHI 150 Price - 2017-2018 in Pakistan', '', 'inherit', 'closed', 'closed', '', '149-revision-v1', '', '', '2018-04-08 06:23:22', '2018-04-08 06:23:22', '', 149, 'http://bike.qeemat.com/uncategorized/149-revision-v1.php', 0, 'revision', '', 0),
(212, 1, '2018-04-17 11:09:02', '2018-04-17 11:09:02', '<div class=\"car-fea-info\">\n<h2>Restyling without Compromising Boldness:</h2>\n							<p>Only recently launched in Pakistan, the Hi-Speed Infinity 150cc 2018 bike comes to take your experience of biking to infinity. It defines a whole new style for the body of a two-wheeler. However, there hasn’t been made any compromise for the boldness and sturdiness which you always expect from a heavy bike of the stature of Hi-Speed. At the same time, you must also be curious about the Hi-Speed Infinity 150cc 2018 price in Pakistan. On this ground, it seems to be quite attractive especially when you put the price against the superior specs standards of the bike.</p>\n							<h2>Bold and Bald:</h2>\n							<p>The Hi-Speed is bold and bald at the same time. It is bald in the sense that the handle and the handgrips are not at a proper height above the fuel tank as observed in low-range motorcycles or heavy bikes. It almost seems to be touching the petrol container. On the other hand, the large fuel tank gets more prominence to impress the viewers on first sight with its styling and graphics. It makes a sharp slope towards the seat which is comparatively low in the middle and gradually rises towards the back.</p>\n<p>The design and placement of the machine, shape of the wheels and the styling of the side parts all contribute to the impressive and bold appearance of the bike.</p>\n								<h2>A Comfort-Yielding Travel:</h2>\n								<p>As the seat is sufficiently wide, soft and a bit flexible, you can sit on it with utmost ease and enjoy long travels without feeling tired. There are two major aims of buying a heavy two-wheeler. Firstly, you go for such a bike to get a stylish and sportier driving experience. That pleasant aspect of the bike is particularly very attractive to the youth who have a fast-running blood in their veins. Secondly, a more powerful bike is better suited for the long inter-city journeys than those of the ordinary 70cc motorcycles.</p>\n								<p>The Hi-Speed Infinity 150cc bike proves itself to be perfect for both the usages. In addition to high power, efficiency and control, it offers a great amount of comfort and safety. So, just feel free to use it for any type of journeys and on every type of terrains. And there is no need to worry the least about tiredness which you have to experience on a low-end bike.</p>\n								<h2>Power and Performance:</h2>\n								<p>Placed among the features and specs of a bike, the power and performance always comes on the top. And the new Hi-Speed Infinity stands out to be the winner of hearts in that respect. It is packed with a 150cc engine which is twice as powerful as that of a 70cc motorbike. The compression ratio is 9:1:1 which also makes a big difference.</p>\n<p>For transmission, there is the advanced 5-speed gearbox which you can logically expect from a bike like Hi-Speed Infinity 150cc. And with 5-speed transmission, you get more gears to handle more versatile road and drive conditions.</p>\n								<p>Another big thing that you are sure to get from this big bike is the self-start mechanism. In addition to totally eliminating the labor involved in kick-starter system, it makes the bike so quick to start.</p>\n								<p>To conclude, available for a reasonable Hi-Speed Infinity 150cc 2018 price in Pakistan, it sounds like a true heavy bike not just by appearance but also by the body dry weight. So, it might be a bit difficult to handle but the sports bike enthusiasts will be able to enjoy the true thrill of sporting with their Hi-Speed which take the joy of travelling to infinity.</p>\n</div>', 'Keeway Superlight 150 Motorcycle in Pakistan - See Price, Pics & Specs', '', 'inherit', 'closed', 'closed', '', '131-autosave-v1', '', '', '2018-04-17 11:09:02', '2018-04-17 11:09:02', '', 131, 'http://bike.qeemat.com/uncategorized/131-autosave-v1.php', 0, 'revision', '', 0),
(213, 1, '2018-04-08 06:31:35', '2018-04-08 06:31:35', '<div class=\"car-fea-info\">\n<h2>What Makes the Difference?</h2>\n							<p>A factory custom and elder sibling of the Superlight 150, the new Keeway 200cc bike is going to earn the title of the one of most sophisticated and durable bikes in the 200cc category. The very design and dimensions of the motorcycle evoke the look and feel of classic customs. The custom-painted and chrome-tinged look of the two-wheeler is especially worth loving. Meanwhile, the grace emanating from its thick-tire and fat-fender body is of special appeal to the style-conscious bike enthusiasts.</p>\n							<p>There are many things in the Keeway Superlight 200 that do not just make the difference but a real difference. The first distinguishing feature is the classic yet bold appearance which is rare to be witnessed elsewhere. Secondly, against the justifiably high Keeway Superlight 200 price in Pakistan, the motorcycle brings a powerful engine that also offers great fuel efficiency. What else do you expect from a heavy bike? Though you may be satisfied with these accomplishments, the Superlight’s functionalities do not end here.</p>\n<p>On the third place, you will see that the 197cc 4-stroke engine does not use the traditional air-cooling mechanism but features an advanced oil-cooled machine. It not only offers the perfect blend of smooth power but also renders durability to the machine. Fourthly, it features the electric or self-starting mechanism without totally eliminating the option of the kick-starter system. So, you will enjoy the renewed style of starting the bike with the push of a button. At the same time, the optional kick-starter system is there to save you from trouble and embarrassment in case the self-starter mechanism goes out of order.</p>\n<p>The fat and grippy tires, mounted on slice-cut wheels, should also be considered a special feature of the Superlight 200cc motorcycle. With the increased road grip, you will be able to enjoy a safe, stable and comfortable riding experience even while driving at high speed on the uneven road.</p>\n								<h2>Better for Short & Long Trips:</h2>\n								<p>There are two main categories of bikes, i.e. city bikes and highway bikes. The city bikes, like Honda’s CD 70 are meant for city roads. In other words, they are to be used for short travels. Such bikes are lightweight and render relatively high fuel efficiency. Being lightweight, they are easy to control for the rider. Secondly, as you have to make frequent stops and stays while keep the engine on, a fuel hungry motorcycle gives a significant boost to the cost of travelling. On the other hand, the highway bikes are more suitable for inter-city trips. They have more powerful engines to make travelling faster.</p>\n								<p>But the Keeway Superlight 200cc bike is going to be a user-friendly and travel-friendly two-wheeler for both the short and long trips. In both the cases, the journey will be extremely safe and affordable. </p>\n								<p>Powered by a 197cc oil-cooled, four-stroke engine, the motorcycle runs smoothly and can attain the speed of over 100 kilometers per hour. The excellent durability makes it fit also for the long haul.</p>\n								<p>The body has a classic design with custom-shaped fuel tank. The fenders, instruments, headlight nacelle and saddle all give it a big-bike, custom appearance. You would love to be seen on it. The fat tires and the custom-look blacked-out wheels also contribute to the powerful and substantial look of the bike. In short, the Superlight has a plenty of grand features that justify the Keeway Superlight 200 price in Pakistan.</p>', 'Keeway Superlight 200 Review, Mileage, Pics and Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '127-autosave-v1', '', '', '2018-04-08 06:31:35', '2018-04-08 06:31:35', '', 127, 'http://bike.qeemat.com/uncategorized/127-autosave-v1.php', 0, 'revision', '', 0),
(214, 1, '2018-04-08 06:31:39', '2018-04-08 06:31:39', '	<div class=\"car-fea-info\">\n<h2>It’s Not That Different:</h2>\n								<p>As ‘change’ is known as the ‘only permanent phenomenon in the world’, people get bored with monotony and always like to experience something fresh and different. The desire to find innovation is even deeper in the people who are always passionate about style and fashion. Innovation is something for them which they cannot dispense with, literally. Unfortunately, the new Union Star Us 70 2018 is not going to impress such individuals as almost all of its parts and components are nearly (or exactly) the same as found in any other standard 70cc bike.</p>\n								<p>Some minor difference, or say distinctions, appear in the graphics and the capacity of the fuel tank. The graphic design on the fuel tank, side covers and certain other parts seems to be fresh and creative. Similarly, the logo design is also quite unique and it has to be so in any case. This also adds to the overall elegance of the motorcycle. Turning to the size of the petrol container, it can accommodate around 9 liters of fuel. So, it is a bit bigger as compared with that of the Honda’s CD 70.</p>\n<h2>The Major Source of Attraction in Union Star’s 70:</h2>\n								<p>As even the latest model of the Union Star 70 bike does seem to show any marked difference with its competitors in the market, it should not be something worth-purchasing in the eyes of the fashion-loving potential buyers. But that is not actually the case. The bike is fetching a good number of sales, thus enabling the manufacturer to survive in the intensely competitive environment.</p>\n<p>Then could be there in the UC that serves as a major source of attraction for the buyers? Let’s explore some interesting facts in this Union Star UC 70 review. Though seemingly an ordinary and a commonplace bike, the new US 70 Union Star does have some special features that contribute to its sales volume. On the first place, the bike is in no way inferior to any of the Chinese two-wheeler brands in the country. It is almost as powerful, efficient and durable as any other bike included in the 70cc category.</p>\n<p>Secondly, it is the price factor that makes UC a good deal. Talking of the Union Star US 70 2018 price in Pakistan, it is available for a very affordable price which makes it come well within the reach of a low-income buyer who can’t think of buying a high priced Japanese bike. And, undoubtedly, this is the major source of attraction for the buyers. Here you should also note that this is the very reason that the less fuel efficient and unruly Chinese bikes have been able to compete with the superior and more technically advanced brands from Japan.</p>\n								<p>The third important thing about the UC 70 is that it is relatively more fuel efficient as compared with several other China bikes. Fuel economy has got incredible demand in the modern era as it not only reduces fuel expenditure but also makes the two-wheeler show an environment friendly behavior.</p>\n', 'Union Star Motorcycle Price in Pakistan | US 70 Bike', '', 'inherit', 'closed', 'closed', '', '122-autosave-v1', '', '', '2018-04-08 06:31:39', '2018-04-08 06:31:39', '', 122, 'http://bike.qeemat.com/uncategorized/122-autosave-v1.php', 0, 'revision', '', 0),
(215, 1, '2018-04-08 06:31:50', '2018-04-08 06:31:50', '<div class=\"car-fea-info\">\n<h2>Eagle Fire Bolt ES70 Review</h2>\n								<p>After Suzuki\'s Power League, another wonderful sports bike has now been introduced to stun the world with its dynamic performance and stylish appearance. Eagle Fire Bolt ES 70 is, therefore, the latest gossip in the world of bikers.</p>\n								<h4>78 cc Engine:</h4>\n								<p>The bike performs with a 12V engine having a displacement of 78 cc, and giving a mileage of 85 Km/l. The engine has a compression ratio of 9.1: 1. An optimum force of 7 PS (horsepower) at 6500 rmp is generated which equals 5.3 Kilowatts. On the other hand, the motorcycle’s maximum torque is 5.4 NM at 6500 rmp.</p>\n<h4>4-Level Transmission System:</h4>\n								<p>A four speed transmission—all forward—is what contributes to the fast speed that can be compared to a fire bolt, hence the name. However, majority of the hardcore sports bikers would disagree. The optimum speed of this bike does not hold a candle to the much more superior Suzuki Hayabusa which runs on a far more powerful 1340 cc engine. Eagle Fire Bolt 70 is, therefore, meant for average users and satisfies their mediocre power needs.</p>\n								<h4>Exquisite Outlook:</h4>\n								<p>The design of the bike is strengthened by a durable steel metal frame. Once again, manufacturers must have kept average bikers in mind before shaping up the beast. Therefore, the style is not wildly sporty. On the other hand, a decent and classic look is maintained, giving the bike slight tweaks for a moderately sporty look. For this reason, it will be easy to handle by even an amateur. Some other sports bikes, such as Suzuki Hayabusa and Intruder have a bedazzling sporty look, but they can’t be handled by just anyone. On the other hand, Eagle’s Fire Bolt reaches out to a much larger audience through its comparatively simpler outlook.</p>\n								<h4>Weight and Body Dimensions:</h4>\n								<P>Weighing 82 Kg, it is, therefore, light and elegant. It measures 1885 x 760 x 990 mm with a convenient seat height of 760 mm. This seat has been designed with a pleasantly large room for two. Therefore, you and your companion can share an adventure on the road.</P>\n								<h4>Road Grip:</h4>\n								<p>With the wheel base being 1210 mm and the ground clearance equal to 135 mm, the bike provides sufficient road grip. Since the maximum speed is easily controllable, maintaining a hold on the ground will not be a challenge. Therefore, chances of accidental slips and flipping over are little.</p>\n<h4>Safety Measures:</h4>\n								<p>The safety is ensured by efficient front and rear drum brakes that stop the vehicle without a jolt. The front 2.25-17-4PR brake has an air pressure equal to 26 lbs per square inch. On the other hand, the rear 2.50-17-4PR brake maintains an air pressure of 32 lbs per square inch.</p>\n								<h4>Fuel Capacity:</h4>\n								<p>The whooping fuel tank capacity of up to 10.5 liters is enough for long journeys as the engine already consumes the fuel efficiently. So, once the fuel tank is filled to its full capacity, you can easily travel for more than 800 kilometers, that is a fairly long distance.</p>\n								<h4>Advanced Digital Speedometer:</h4>\n								<p>The calibrated analogue dial for telling you the speed of your bike stands outdated now: here is something new for you! An advanced digital speedometer updates you about your current speed. A digital clock is also available so that you can find out the time at a single glance.</p>\n								<h4>Price & Color Options:</h4>\n								<p>The Eagle Fire Bolt ES 70 price in Pakistan is slightly over fifty thousand. Red, black and blue are the chic color options for giving a striking look to the bike. Your trendy new partner will definitely earn you a great deal of attention on the road when you cut through the air riding on it.</p>\n								<h4>Bottom Line:</h4>\n								<p>To sum up, the Eagle\'s marvelous product is a wonderful option for all average bikers who want to upgrade to a more innovative design and technology while still being able to afford the price and handle the power conveniently.</p>', 'Eagle Fire Bolt ES70 Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '109-autosave-v1', '', '', '2018-04-08 06:31:50', '2018-04-08 06:31:50', '', 109, 'http://bike.qeemat.com/uncategorized/109-autosave-v1.php', 0, 'revision', '', 0),
(216, 1, '2018-04-18 07:18:24', '2018-04-18 07:18:24', '<div class=\"car-fea-info\">\n<p>The Eagle 70 is a small four stroke motor cycle produced recently by Eagle. Introduced to compete against rival two-stroke small capacity motor cycles, the Eagle DG 70 Firebird is a four-stroke, small capacity motor cycle, with an engine displacement of only 72 cm³. With Eagle’s specialty four-stroke technology, getting extra mileage from every cc that will take you onto the road ahead of everybody. The new eye-catching graphics, comfortable new seat design and its exquisite aero dynamic shape have made it a best choice and a perfect partner, longer better cushioned seat makes the going more comfortable for one up or two up riding!</p> \n<p>The newly introduced Eagle DG 70 is very cheap to operate with a typical fuel economy of 40 miles (64 kilometers) in a liter which promises you the most economical ride of your life. A solid, reliable and very practical competitor, this bike offers 50 cc economy with a power of 70 cc vehicle. The tank carries a 10 liters and a petrol reserve capacity of 1 liter too. The vehicles fuel capacity that is one liter more than Honda CD 70 whose tank carries a maximum fuel capacity of 9 liters.</p>\n								<p>The Eagle Firebird comes loaded with a 78 cc engine that is air cooled, 4 strokes, and single cylinder, the new improved motor bike produces a top power of 7.0 PS at 6500 rpm and a peak torque of 5.4 nm at 6500 rpm. The splendidly designed vehicle uses a 4 speed gearbox which follows all down gear shifting pattern. It comes with a CDI ignition and handles lock. The starting pattern is kick start only.</p>\n<p>The Eagle bike has been equipped with standard brakes and suspension. The motor has double acting hydraulic shock absorbers with three steps adjustable coil springs. The suspension system available in the vehicle is very advanced and provides greater control and stability to the bike. Apart from these, the EagleE DG 70 bike has standard tyres and multi-spoke wheels. No other bike in the class comes with adjustable suspension so far.</p>\n<p>The powerful breaking system present in the Eagle DG 70 has greatly increased the controlling and handling of the bike. The 130 mm internal expanding shoe type non-asbestos type brake at the front wheel and 110 mm brake at the rear control the bike when moving in a high speed and helps in decelerating the bike instantly.</p>\n<p>The aero-dynamically designed vehicle is available in majestic colors like blue, grey, black and red with a speculated price tag of Rs. 47,000.</p></div>', 'Eagle DG 70 Firebird Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '107-autosave-v1', '', '', '2018-04-18 07:18:24', '2018-04-18 07:18:24', '', 107, 'http://bike.qeemat.com/uncategorized/107-autosave-v1.php', 0, 'revision', '', 0),
(217, 1, '2018-04-18 07:32:01', '2018-04-18 07:32:01', '<div class=\"car-fea-info\"><p>What does an ordinary man require from a motorbike? The answer is reliability, worth for his money, fuel efficiency and style and most importantly style. Even though a bike is an ordinary vehicle, easily bought and easily maintained, it does not change the fact that every bike owner wants their bike to be as stylish as can be. This is why Metro has released Metro MR 70 Dabang.</p> \n<p>Much like the bikes in the movie Dabang, this bike is also aimed at style, power, reliability and the same sense of action that the movie incorporates. Metro MR 70 Dabang is able to do this through specifications and great performance which makes it a winner. The bike comes with a wet sump, single cylinder engine, with four strokes, two valves and an air cooling system equipped with SOHC (single over head cam) chain drive. With a piston displacement of 72 cm, a capacitor discharge ignition (CDI) of great quality, and a dry paper element air filtration system, the bike is great at running and also atmosphere friendly.</p>\n								<p>The Metro MR 70 is an instant stunner with its good looks outside and is similarly an instant charmer with its great working inside. Being 1885mm long, 760mm wide and 990mm tall; and having a dry weight of 82 Kg, the bike has a perfect size and weight. Then inside this body of fine metal, it comes with a fuel tank capacity of 9 liters and an additional 1 liter reserve. Furthermore, it has an oil capacity of 800ml at the first fill, and then 700ml at changing intervals.</p>\n<p>The transmission type of the bike is four-speed constant mesh; and it has a dry charged, 12V 2.5A battery that gives it a long battery life. This gives the bike the same power of action seen in the movie Dabang. Metro MR 70 Dabang contains style not only through its looks but also through its other features. These include a speedometer, odometer, Indicator lights, neutral position indicator, turn signal indicator and an ON/OFF switch. Since all these features are better than before, they provide an all together new experience of power and style within a 70 CC bike.</p>\n<p>The bike comes in two colors: black and red, with a sleek blue design covering its strong body. The fact that the color black is more popular stands strong, and that is not only due to its association with the movie Dabang, but because of the sleekness of the color black on this bike. However that does not mean that the bike does not look any good in red.</p>\n								<p>Features like a strong engine, glossy outlook, reliable torque (max) of 5.39 N-m@6,500rpm/min, solid built, and trustworthy fuel system give the bike an edge over others. Finding parts are no difficulty with this bike, neither is maintenance or running.</p>\n								<p>Overall the style of the Metro MR 70 Dabang forms its identity and its performance takes it further ahead.</p></div>', 'Metro MR 70 Dabang Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '102-autosave-v1', '', '', '2018-04-18 07:32:01', '2018-04-18 07:32:01', '', 102, 'http://bike.qeemat.com/uncategorized/102-autosave-v1.php', 0, 'revision', '', 0),
(218, 1, '2018-04-08 07:15:56', '2018-04-08 07:15:56', '<div class=\"car-fea-info\">\r\n<h2>Restyling without Compromising Boldness:</h2>\r\n							<p>Only recently launched in Pakistan, the Hi-Speed Infinity 150cc 2018 bike comes to take your experience of biking to infinity. It defines a whole new style for the body of a two-wheeler. However, there hasn’t been made any compromise for the boldness and sturdiness which you always expect from a heavy bike of the stature of Hi-Speed. At the same time, you must also be curious about the Hi-Speed Infinity 150cc 2018 price in Pakistan. On this ground, it seems to be quite attractive especially when you put the price against the superior specs standards of the bike.</p>\r\n							<p>Bold and Bald:</p>\r\n							<p>The Hi-Speed is bold and bald at the same time. It is bald in the sense that the handle and the handgrips are not at a proper height above the fuel tank as observed in low-range motorcycles or heavy bikes. It almost seems to be touching the petrol container. On the other hand, the large fuel tank gets more prominence to impress the viewers on first sight with its styling and graphics. It makes a sharp slope towards the seat which is comparatively low in the middle and gradually rises towards the back.</p>\r\n<p>The design and placement of the machine, shape of the wheels and the styling of the side parts all contribute to the impressive and bold appearance of the bike.</p>\r\n								<h2>A Comfort-Yielding Travel:</h2>\r\n								<p>As the seat is sufficiently wide, soft and a bit flexible, you can sit on it with utmost ease and enjoy long travels without feeling tired. There are two major aims of buying a heavy two-wheeler. Firstly, you go for such a bike to get a stylish and sportier driving experience. That pleasant aspect of the bike is particularly very attractive to the youth who have a fast-running blood in their veins. Secondly, a more powerful bike is better suited for the long inter-city journeys than those of the ordinary 70cc motorcycles.</p>\r\n								<p>The Hi-Speed Infinity 150cc bike proves itself to be perfect for both the usages. In addition to high power, efficiency and control, it offers a great amount of comfort and safety. So, just feel free to use it for any type of journeys and on every type of terrains. And there is no need to worry the least about tiredness which you have to experience on a low-end bike.</p>\r\n								<h2>Power and Performance:</h2>\r\n								<p>Placed among the features and specs of a bike, the power and performance always comes on the top. And the new Hi-Speed Infinity stands out to be the winner of hearts in that respect. It is packed with a 150cc engine which is twice as powerful as that of a 70cc motorbike. The compression ratio is 9:1:1 which also makes a big difference.</p>\r\n<p>For transmission, there is the advanced 5-speed gearbox which you can logically expect from a bike like Hi-Speed Infinity 150cc. And with 5-speed transmission, you get more gears to handle more versatile road and drive conditions.</p>\r\n								<p>Another big thing that you are sure to get from this big bike is the self-start mechanism. In addition to totally eliminating the labor involved in kick-starter system, it makes the bike so quick to start.</p>\r\n								<p>To conclude, available for a reasonable Hi-Speed Infinity 150cc 2018 price in Pakistan, it sounds like a true heavy bike not just by appearance but also by the body dry weight. So, it might be a bit difficult to handle but the sports bike enthusiasts will be able to enjoy the true thrill of sporting with their Hi-Speed which take the joy of travelling to infinity.</p>\r\n', 'Keeway Superlight 150 Motorcycle in Pakistan - See Price, Pics &amp; Specs', '', 'inherit', 'closed', 'closed', '', '131-revision-v1', '', '', '2018-04-08 07:15:56', '2018-04-08 07:15:56', '', 131, 'http://bike.qeemat.com/uncategorized/131-revision-v1.php', 0, 'revision', '', 0),
