(802, 1, '2018-04-18 08:18:24', '2018-04-18 08:18:24', '<div class=\"car-fea-info\"><p>RAVI Hamsafar is a motorcycle company which is newly approved by the government of Pakistan. It is certified by PSQCA as the 5th brand in Motorcycle Industry. Ravi new model ensures better reliability, stability and quality. It is based on Japanese technology which is 72cc, 4 stroke, and single cylinder and weighs almost 82kg.</p>\r\n<p>Ravi’s 4 stroke 72cc engine has made a benchmark in mileage with mile coverage of 70km per liter. The compression ratio of Ravi 70cc is 8.1:1, maximum Horse Power is 7.0 PS @ 6500 rpm that is able to produce 5.4 N.M @ 6500 rpm torque. The Transmission rate is 4 speed constant mesh with all gears forward. The bike can store almost 9.5 liters of petrol on the stylishly designed tanker. The bike has to be started with the kick that uses capacitor discharge ignition system. The suspension of the bike is highly fixed and comfortable with coil springs Telescopic Hydraulic Forks in front and double acting hydraulic shock absorbers, with coil springs at rear gives really a smooth drive. The Speedo meter is stylish and colorful with sleek design. The headlights and indicators are equally smart with crystal lights. The overall impression is excellent. The bike looks descent and smooth while on the road. Compare the Ravi-72cc price in Pakistan with other companies invoice and get the liveliest experience of unique in design with vibrant colors of this bike.</p></div>', 'Ravi Motorcycles Prices in Pakistan | Ravi Hamsafar 70CC, 125CC', '', 'inherit', 'closed', 'closed', '', '67-revision-v1', '', '', '2018-04-18 08:18:24', '2018-04-18 08:18:24', '', 67, 'http://bike.qeemat.com/uncategorized/67-revision-v1.php', 0, 'revision', '', 0),
