(807, 1, '2018-04-18 08:24:42', '2018-04-18 08:24:42', '<div class=\"car-fea-info\"><p>There are so many companies in Pakistan that are manufacturing various types and models of bikes including 70cc, 100cc and 125cc for the convenience of customers. Similarly, Super Star is one of them, established in 1994 that assembles bikes on modern plants with high technology involved in it. With continuous research and improvement it has designed an awesome bike named as SUPER STAR SS -70. This is a blend of excellent new features and figures.</p>\r\n<p>Internally, it is manufactured with SS-70 runs with 4 Stroke engine, 4-speed manual transmission, Single Cylinder, Air Cooled and Overhead Cam Shaft. Its Compression Ratio is 8.8:1 and ignition is CDI, Suspension Rear Dual Dumpers with 5-step adjustable spring preload, rated power of 4.2KW, multi plated wet clutch and drum brakes. The fuel consumption is very economical as it covers 100km in 1.4 Liter of petrol. SS-70 has got a vibrant exterior with improved front fork, attractive stickers on the tank and side covers, stylish digital meter that gives you accurate running and mileage, crystal rear and front headlights and indicators as well. Overall, this bike has gorgeous and high quality color finishing, with more lighter, compact and powerful engine that rounds up to maximum power with just a little movement of hand. The Super Star SS-70cc price can be compared with other models available in Pakistan. Try the new discovery of amazing features introduced by Super Star automobiles.</p></div>\r\n', 'Super Star Motorcycle Price in Pakistan | SS 70 Bike', '', 'inherit', 'closed', 'closed', '', '59-revision-v1', '', '', '2018-04-18 08:24:42', '2018-04-18 08:24:42', '', 59, 'http://bike.qeemat.com/uncategorized/59-revision-v1.php', 0, 'revision', '', 0);
