(810, 1, '2018-04-18 08:30:31', '2018-04-18 08:30:31', '<div class=\"car-fea-info\"><p>Qingqi is a Chinese bike recently introduced in Pakistan. It has been designed and manufactured with latest technology, meeting people’s needs and demands. Qingqi is 100cc four stroke powerful bikes with low consumption of fuel, making it efficient and effective for its riders. In Pakistan mostly two shapes of bikes are famous, one is like CD 70 and the other one is like CG 125. This Qingqi is a combo of both CD and CG. Not so heavy and not so light, but gives you immense pleasure once you are on to it.</p>\r\n<p>Externally, it is carefully designed with appealing color combination and aerodynamics. Soundless shinning silencer, powerful double point headlight with sporty touch, high- tech and more visible crystal brake lights and indicators, heavy mud guards and durable tyers make its ride comfortable and impressive. Internally, you will find it long lasting, less sound producing engine as compared to other bikes with O.H.V intake system, 12V CDI ignition, 4 speed transmissions, and big fuel tank with 9.8 liter of capacity which is more than other available bikes in Pakistan of this range. It can store 1.5 liter of fuel as reserve. You can compare Qingqi CD100 prices in Pakistan with other company bikes that are in competition with it. Go and get experience with Elite four strokes CD100Q for better life.</p></div>', '2016 Qingqi CD 100 Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '50-revision-v1', '', '', '2018-04-18 08:30:31', '2018-04-18 08:30:31', '', 50, 'http://bike.qeemat.com/uncategorized/50-revision-v1.php', 0, 'revision', '', 0),
(255, 1, '2018-04-08 07:54:43', '2018-04-08 07:54:43', '<div class=\"car-fea-info\">\r\n<h2>QINGQI CD 100 2016 Review</h2>\r\n								\r\n								<p>Qingqi is a Chinese bike recently introduced in Pakistan. It has been designed and manufactured with latest technology, meeting people’s needs and demands. Qingqi is 100cc four stroke powerful bikes with low consumption of fuel, making it efficient and effective for its riders. In Pakistan mostly two shapes of bikes are famous, one is like CD 70 and the other one is like CG 125. This Qingqi is a combo of both CD and CG. Not so heavy and not so light, but gives you immense pleasure once you are on to it.</p>\r\n<p>Externally, it is carefully designed with appealing color combination and aerodynamics. Soundless shinning silencer, powerful double point headlight with sporty touch, high- tech and more visible crystal brake lights and indicators, heavy mud guards and durable tyers make its ride comfortable and impressive. Internally, you will find it long lasting, less sound producing engine as compared to other bikes with O.H.V intake system, 12V CDI ignition, 4 speed transmissions, and big fuel tank with 9.8 liter of capacity which is more than other available bikes in Pakistan of this range. It can store 1.5 liter of fuel as reserve. You can compare Qingqi CD100 prices in Pakistan with other company bikes that are in competition with it. Go and get experience with Elite four strokes CD100Q for better life.</p></div>', '2016 Qingqi CD 100 Price in Pakistan', '', 'inherit', 'closed', 'closed', '', '50-revision-v1', '', '', '2018-04-08 07:54:43', '2018-04-08 07:54:43', '', 50, 'http://bike.qeemat.com/uncategorized/50-revision-v1.php', 0, 'revision', '', 0),
(812, 1, '2018-04-18 10:16:36', '2018-04-18 10:16:36', '<div class=\"car-fea-info\"><p>As the economy is falling down, oil prices are increasing; bikes have become the only lifeline for most of the mediocre working class to cover their distances in lowest possible costs. The competitors are struggling hard to introduce such bikes that are good looking, energy efficient and durable. With this strategy, Metro has brought into the competition its new model-MR70. This bike has two editions, one is simple and the other is a special one.</p>\r\n<p>You can check Metro MR70 prices in Pakistan for both the editions. Mostly, companies design bikes that are almost same in nature and specifications. But, Metro has designed something new in its bikes. From front to back, the looks are different. Apart from the simple MR70 bike, Metro has also launched Metro Boom, Metro Jeet and not to forget the one and only, Metro Dabang.</p>\r\n								<p>Talking specifically about the Speedometer, Metro is one of the first bike makers to introduce digital speedometer even in normal models. The indicators, rear break light and headlights all are unique. The indicators are oval in shape and brake lights are stretched and broader. The liver is different from the other bikes with more stylish looks, and even side mirrors are smartly designed.</p>\r\n								<p>This time the monogram and stickers are more pleasing and different as well. To control the efficiency of this motorcycle and to make it more comfortable, durable and reliable, the bike is powered with four stroke OHC system and latest CDi system. The torque and horsepower is 70 CC. Metro Pakistan can store 9 liters of petrol in its tank and weighs almost 82kg, less than other local bikes available in Pakistan.</p></div>', 'Metro MR 70 Price in Pakistan | Metro Pakistan', '', 'inherit', 'closed', 'closed', '', '46-revision-v1', '', '', '2018-04-18 10:16:36', '2018-04-18 10:16:36', '', 46, 'http://bike.qeemat.com/uncategorized/46-revision-v1