(821, 1, '2018-04-18 10:38:38', '2018-04-18 10:38:38', '<div class=\"car-fea-info\"><p>Ghani is a new automobile company started its journey in 2005. It has gained a lot of confidence in its manufacturing sector. These bikes are stylish, comfortable and fuel economical. I must tell you one thing that 70cc and 125cc bikes are most commonly used in Pakistan because of its midrange price and easy drive. That’s why most of the companies are heading towards the manufacturing of 70cc and 125cc models.</p>\r\n<p>Ghani automobiles have also targeted the same market with one of its new model Gi70 cc. This bike has been carefully designed from its interior and exterior. Let’s figure it out. Internally, this bike is furnished with a 4-Stroke Air Cooled OHC engine that is of 70cc power and it can cover almost 84km per liter of petrol. It has two types of models; one that is a self-starter with remote control while the other is kick start. It can store up to 9 liters of petrol in its oil tank.</p>\r\n								<p>Externally, it is a stylish one with enticing Alloy Rims, Heavy Duty Front Shock Absorbers, and Adjustable Rear Shock, black handles and clutches, colorful head with RPM & Speedo Meter with the option of Gears Indication. It highlights the no. of gear on which the bike is running on. The overall running is quite light and comfortable. You can compare Ghani Gi 70cc price with other bikes in Pakistan. Overall, this new bike gives you more mileage, 2 years or 12000 km warranty where as other companies gives you lesser warranty. You can get the real pleasure of Ghani bikes.</p></div>', 'Ghani Gi 70 Price in Pakistan | Gi 70CC', '', 'inherit', 'closed', 'closed', '', '42-revision-v1', '', '', '2018-04-18 10:38:38', '2018-04-18 10:38:38', '', 42, 'http://bike.qeemat.com/uncategorized/42-revision-v1.php', 0, 'revision', '', 0),
