(827, 1, '2018-04-18 11:04:43', '2018-04-18 11:04:43', '<div class=\"car-fea-info\">	\r\n								<p>Crown is a living picture of reality. A motorcycle company established with the cooperation of China. Keeping in mind the growing importance of engine and fuel efficiency, Crown has introduces its latest CRLF-70CC bike in the market, which is powerful and more dynamic. The Crown CRLF 70 prices in Pakistan are of immense value to be compared, as there are so many bikes manufacturing companies in the market.</p>\r\n<p>Telling you its features, you will find it similar to other bikes. The only difference which keeps the CRLF 70CC different from other 70 CC bikes is that, it has dual options of self-start ignition and kick-start with manual gears. The bike speeds up to 80km to 90km per hour quite easily and covers more than 70km per liter, which shows that it is a fuel-efficient motorcycle. It has the fuel storage capacity of 9 liters. The overall weight of CRLF 70CC bike is 85 kg, which is little more than <a href=\"http://bike.qeemat.com/china/metro-mr-70-price-in-pakistan.php\">Metro MR 70</a> and <a href=\"http://bike.qeemat.com/china/unipak-au-70-price-in-pakistan.php\">UniPak AU 70</a> bikes. The compression and displacement of bike is same as others. Externally, the bike is impressive with multicolor designs on the fuel tanks and on the side covers. The drive is smooth and comfortable with the resistive suspension system installed in its shocks. The headlights and indicators are all crystal that shines more at night. As the bike is new, so it will take time to make the company popular and trustworthy among the bike riders in Pakistan.</p></div>', 'Crown CR 70 Price in Pakistan | Crown Motorcycle', '', 'inherit', 'closed', 'closed', '', '36-revision-v1', '', '', '2018-04-18 11:04:43', '2018-04-18 11:04:43', '', 36, 'http://bike.qeemat.com/uncategorized/36-revision-v1.php', 0, 'revision', '', 0),
