(829, 1, '2018-04-18 11:08:18', '2018-04-18 11:08:18', '<div class=\"car-fea-info\">		\r\n								<p>UniPak presents itself as the most trustworthy and reliable company, which is working to manufacture 70CC motorcycles in Pakistan. Following the targets of making the product which is equipped with latest engineering, it has introduced AU-70 CC bike. UniPak is proving itself as the most cost effective and efficient bike makers with multi functions and features. AU-70 CC prices in Pakistan are comparatively lower to its competitors like Honda CD 70.</p>\r\n<p>On the road, you will find it going more than 70km per liter, which is the basic need, as the oil prices are getting higher. The bike is designed with beautiful color combination and attractive graphics on the oil tank and side covers, solid and comfortable seat that avoids jumps to affect your back, powerful front and rear shocks with good suspension, crystal indicators, back and headlights, energetic four stroke engine that don\'t pollute the environment and engine jamming risks. The head of Speedo meter is really stylish and astounding. Au-70 CC can preserve 9 liters of petrol for long drive. One thing is important to note that AU-70CC loses its pick after some years and the engine gets weaker as compared to Honda CD 70. Overall, this 83kg, lightweight bike is capable to compete with other bikes in the market, as the fundamental features are attractive and worthy to experience. The ignition is equipped with the latest CDI capacitor discharge ignitions system that does not require any adjustment.</p></div>', 'Unipak AU 70 Price in Pakistan | Unipak CDI AU-70', '', 'inherit', 'closed', 'closed', '', '32-revision-v1', '', '', '2018-04-18 11:08:18', '2018-04-18 11:08:18', '', 32, 'http://bike.qeemat.com/uncategorized/32-revision-v1.php', 0, 'revision', '', 0),
(259, 1, '2018-04-08 07:55:55', '2018-04-08 07:55:55', '<div class=\"car-fea-info\">\r\n<h2>Unipak AU 70 Review</h2>\r\n								\r\n								<p>UniPak presents itself as the most trustworthy and reliable company, which is working to manufacture 70CC motorcycles in Pakistan. Following the targets of making the product which is equipped with latest engineering, it has introduced AU-70 CC bike. UniPak is proving itself as the most cost effective and efficient bike makers with multi functions and features. AU-70 CC prices in Pakistan are comparatively lower to its competitors like Honda CD 70.</p>\r\n<p>On the road, you will find it going more than 70km per liter, which is the basic need, as the oil prices are getting higher. The bike is designed with beautiful color combination and attractive graphics on the oil tank and side covers, solid and comfortable seat that avoids jumps to affect your back, powerful front and rear shocks with good suspension, crystal indicators, back and headlights, energetic four stroke engine that don\'t pollute the environment and engine jamming risks. The head of Speedo meter is really stylish and astounding. Au-70 CC can preserve 9 liters of petrol for long drive. One thing is important to note that AU-70CC loses its pick after some years and the engine gets weaker as compared to Honda CD 70. Overall, this 83kg, lightweight bike is capable to compete with other bikes in the market, as the fundamental features are attractive and worthy to experience. The ignition is equipped with the latest CDI capacitor discharge ignitions system that does not require any adjustment.</p></div>', 'Unipak AU 70 Price in Pakistan | Unipak CDI AU-70', '', 'inherit', 'closed', 'closed', '', '32-revision-v1', '', '', '2018-04-08 07:55:55', '2018-04-08 07:55:55', '', 32, 'http://bike.qeemat.com/uncategorized/32-revision-v1.php', 0, 'revision', '', 0),
(261, 1, '2012-05-07 08:11:24', '2012-05-07 08:11:24', '<div class=\"car-fea-info\">\r\n<p>In a country like Pakistan where majority of the population is not rich enough to afford big or small cars, bikes are the next best transport option. It is local companies like Honda, which makes one of the best bikes, which make it accessible for the population to own this mode of transport remaining within their budget. Amongst 70 CC bikes, Honda is taking the lead with its many durable and great models, packed with the best of technologies. The Honda CD 70 2012 is one of these, which comes with the latest Japanese technology and a better look than its previous models.</p>\r\n								<p>Coming to the specifications of the bike, it is a kick start bike which will take your life to the high gear with its excellent specifications. The Honda CD 70 is built with a 4 stroke engine, OHC singly cylinder cooled by air; and has a displacement of 72 cm. Moreover, the engine also comes with a 2-year warranty that not only makes it reliable but also fuel efficient.</p>\r\n<p>This brings us to the bike\'s fuel capacity which is 9 liters, with 1 liter of reserve storage. It has a transmission of continuous 4 speed mesh; multiple wet plates clutch, smooth 4 gear box and a compression ratio of 8:8:1. The fact that sets the Honda CD 70 2012 apart from other bikes is the more mileage it can give in 1 liter of petrol.</p>\r\n								<p>On the outside, the bike is a stunning black shine, with a new and improved design and pattern. With a length of 1900 m, width of 760 mm and height of 995 mm the bike is a perfect size; and also a perfect weight at 82kg. The Honda CD 70 2012 has a frame of backbone type. All these features make it good looking, along with being durable.</p>\r\n<p>In the new and improved Honda CD 70 2012 model, the features have been enhanced and added to it with the new seat design and rear cowl along with the graphics of the bike that also been made more beautiful. The 2012 model of the bike has the latest switch assembly, controlled by the left hand that makes the running and operating of the bike easier and better.</p>\r\n								<p>The security of the bike, both technically and socially have also been enhanced through multiple features. The strong side cover with lock helps assure that the bike can safely and soundly be secured from the horror of being stolen. The non-asbestos eco-friendly brakes make sure that the running of the bike is smooth and secure; this also makes the bike less prone to accidents and gives the user more control over the bike.</p>\r\n								<p>Available in colors red and black, aided with its new and improved design the Honda CD 70 2012 is an excellent bike that wins in its appearance as well as running. The smooth suspension, extra mileage and sound brakes make it a comfortable and secure ride. The Honda CD 70 price in Pakistan is just about right considering how much the bike offers to the everyday man, to make life more enjoyable and easier.</p>\r\n\r\n</div>', 'Honda CD 70 2012 Price in Pakistan', '', 'publish', 'open', 'open', '', 'honda-cd70-2012-price-in-pakistan', '', '', '2018-04-19 05:47:19', '2018-04-19 05:47:19', '', 0, 'http://bike.qeemat.com/?p=261', 0, 'post', '', 0),
