(283, 1, '2018-04-19 08:41:36', '2018-04-19 08:41:36', '<div class=\"car-fea-info\">\n <h2>Looking for a Faithful Companion for an Inter-City Travel?</h2>\n                            <p>The Honda’s CD 70 bike is already fulfilling the needs of the users for city travels. The bike offers a highly economically ride with control for the rider. It is considered handy especially for the aged people who can conveniently take it on the congested roads and narrow streets.</p>\n <p>But is the CD, from the house of Honda, also suitable for a long inter-city ride? Many will say “no”. Why? It is particularly because the two-wheeler not only annoys but also makes the riders tired with its vibrations. So, how much do you expect the Honda CG 125 2018 price in Pakistan to enjoy all these advantageous features? It is only around one hundred and six thousand rupees – that is, just according to your expectations.</p>\n                            <p>If you are looking for a better alternative, it is the new CG 125 2018 from the same Japanese manufacturer, Honda. In comparison with CD, the bike weighs round 17 kilograms heavier. In addition to fulfilling the requirements of the body structure, it also serves to curb vibration and makes the drive more stable and peaceful.</p>\n <p>The 125cc machine of the CG is not only wonderfully powerful, it also features the latest tech standards for utmost efficiency. The OHV-powered 4-stroke engine utilizes the air cooling mechanism to prevent the machine from overheating while you are on a long drive and have to cover the distance of hundreds of kilometers.</p>\n                                <h2>Kick-Start with 4-Speed Continuous Mesh:</h2>\n                                <p>If you talk of starting mechanism, the bike is likely to disappoint the Honda CG fans for it does not support the electric or automatic start system. In other words, they will have to rely on and do with the traditional kick starter system. It involves the laborious activity of repeatedly striking your foot against the kick lever to put the vehicle on the road. You will also face difficulty while trying to start the bike on a road with busy traffic.</p>\n <p>On the other hand, the users will have the advantage of the 4-speed continuous mesh transmission system. This advanced technology not only smoothens the gear shifting but also provides a suitable gear for every type of road and drive situations.</p>\n                    <h2>CG Honda versus GD Suzuki:</h2>\n                    <p>Comparing Honda’s CG 125 with Suzuki’s GD110, you come across certain differences. The major and most obvious difference is that of the big price gap. The difference between the Honda CG125 2018 price in Pakistan and that of the Suzuki GD 110S is of nearly 30,000 rupees. Don’t you find it a significantly wide gap?</p>\n<p>Here is yet another surprising thing about the differences between CG and GD. It is related to the power generation capacity. While the GD features a 110cc engine, the CG from Honda has a more powerful 125cc machine. It obviously means, with CG, you can not only experience more energy and speed but also save a significant amount on account of the Honda CG 125 2018 price in Pakistan.</p>\n                                <p>However, in terms of color variations, the GD 110 beats its CG counterpart as the formers offers three body color variations of red, black and gray against the two red and black variants offered by the latter.</p>\n</div>', 'Honda\'s New Model CG 125 2018 in Pakistan - See Price & Pictures', '', 'inherit', 'closed', 'closed', '', '281-autosave-v1', '', '', '2018-04-19 08:41:36', '2018-04-19 08:41:36', '', 281, 'http://bike.qeemat.com/uncategorized/281-autosave-v1.php', 0, 'revision', '', 0),
