(294, 1, '2018-03-04 09:04:45', '2018-03-04 09:04:45', '<div class=\"car-fea-info\">\r\n<h2>New CB 150 F – Incredible Safety, Style and Fuel Economy:</h2>\r\n\r\n								<p>Honda has been dominating the motorcycle market in the country for decades. The bikes from this Japanese brand are known for their smooth drive, great fuel economy and high resale value. Various successful models belong to the categories of 70cc, 100cc, 125cc and 150cc.</p>\r\n\r\n								<p>Unveiled on May 3, 2017 at Emporium Mall, Lahore, the new CB 150F is the latest addition to the line of 150cc bikes. In the launch ceremony, Afaq Ahmed, GM Plants Atlas Honda, claimed that new bike is a pack of advanced safety features that will cater to the local needs of the customers.</p>\r\n\r\n								<p>As you can see in the Honda CB 150F pictures, the motorcycle has got a graceful and attractive appearance. The styling of the fuel tank is just like that of a sports bike. The stylish graphics impress the onlookers at the very first sight. Overall, it also gives a bit feel of a heavy bike.</p>\r\n\r\n								<p>CB 150F is a class leader also in terms of fuel economy. In other words, it gives greater mileage than that of all the other motorcycles in the 150cc category. Undoubtedly, for any potential buyer, it is one of the most attractive features. </p>\r\n\r\n<p>A vehicle with fuel economy not only cuts the travel expenses but it is also less harmful for the environment. In fact, the new 150F is an all-in-one package for the enthusiastic bike riders.</p>\r\n\r\n								<h2>Salient Features:</h2>\r\n\r\n								<p>Honda CB 150F makes its way to the market at a time when buyers from the high-end segment are in dire need of it – they want new style, greater safety, high fuel economy, more stable drive and, of course, a confident ride. The new bike is going to offer not only all these features but also many more.</p>\r\n<p>Let’s have a brief look at some of the salient features of the new motorbike:</p>\r\n\r\n					\r\n\r\n								<ul>\r\n\r\n								<li><strong>Powerful Turbo Engine:</strong> The 150cc Turbo Engine generates enough power to give the rider an energetic and confident ride on all the road conditions. In fact, you can enjoy an adventurous ride on it.</li>\r\n\r\n								<li><strong>5-Gear Transmission:</strong> The aim of the 5-gear transmission system is to provide a more stable travelling experience especially at the high speeds. Such a feature may also contribute to the mileage. The shifting of gears up or down is also so smooth.</li>\r\n\r\n								<li><strong>LED Fog Lights:</strong> High quality LED fog lights are there to increase the road visibility in the harsh and unfavorable environmental conditions, such as fog and dust storm.</li>\r\n\r\n								<li><strong>Maintenance-free Powerful Battery:</strong> Don’t you think the maintenance of the battery is a big hassle? But you won’t have to face it here. CB 150F comes with a powerful maintenance-free backup battery. It has a considerably long life.</li>\r\n\r\n								<li><strong>Magnetic Ignition Protection:</strong> The Neodymium Magnetic Key offers better ignition protection as the ignition switch will accept no key other than the original one. It is an impressive feature to prevent theft and burglary.</li>\r\n\r\n								<li><strong>Awesome Riding Experience:</strong> Honda’s new 150cc bike has been designed and empowered to give an awesome riding experience both on the highway and city roads. The great technological accomplishments serve to make the drive so smooth and impressive. Comfort-yielding features of the bike render it more suitable for the long journeys.</li>\r\n\r\n								</ul>\r\n<h2>Honda CB 150F Price in Pakistan:</h2>\r\n\r\n								<p>What do you expect Honda CB 150F price in Pakistan? It is around Rs. 159,000. The advanced measures for style, safety, stability, comfort and fuel economy justify the bike’s price. It is for the buyers from the high-end segment who cannot compromise for style and adventure.</p>\r\n\r\n</div>', 'Honda CB150F Price in Pakistan 2018 Model', '', 'publish', 'open', 'open', '', 'honda-cb150f-price', '', '', '2018-04-19 08:30:08', '2018-04-19 08:30:08', '', 0, 'http://bike.qeemat.com/?p=294', 0, 'post', '', 0),
