(305, 1, '2017-04-08 09:16:58', '2017-04-08 09:16:58', '<div class=\"car-fea-info\">\r\n<h2>Why Bag Trust on Honda CG?</h2>\r\n							<p>There can several logical reasons concerning “Why should you bag trust on Honda CG 125 2017?” Firstly, the product comes from one of the most reliable motorcycle manufacturing companies in the country, i.e. Atlas Honda. Atlas Honda Limited is not a local firm but a joint venture between the Honda Motors Co. Limited Japan and the Atlas Group Pakistan.</p>\r\n							<p>Secondly, the number of Honda bikes on the roads of Pakistan is greater than the number of bikes from other brands taken together. When the great majority of people in Pakistan are already bagging trust on Honda bikes, why not you? So against the justifiably high Honda CG 125 2017 price in Pakistan, the motorbike deserves your trust.</p>\r\n<p>Thirdly, it is the high resale value of motorcycles from Atlas Honda that should convince you to put trust on the new CG 2017 model. The high resale value indicates that the bike’s technology is advanced, durable and trustworthy. Owing to the great demand of used Honda bikes, they can be easily sold in the market.</p>\r\n							<h2>CG 125 2017 – More Power against Less Fuel:</h2>\r\n								<p>As usual, the Honda’s CG 125 2017 is installed with a 125 cc 4-stroke engine which makes the drive so powerful and energetic. The 14-Horse Power thrust generated by its machine is the result of the advanced Japanese technology. Such a powerful drive makes the rider elated and confident.</p>\r\n								<p>Meanwhile, you must be concerned about the fuel consumption. Logically, when you need more power, it will be at the cost of greater fuel consumption. But the advanced Japanese technology serves to go against such logic, i.e. here you will get more power with less fuel consumption. Doesn’t this make the new Honda CG 2017 a fairly attractive deal for the potential buyers?</p>\r\n<h2>Brighter Lights and Easy Startup:</h2>\r\n								<p>If you have to travel at night on the long roads without traffic lights, the importance of brighter lights increases by manifolds. With brighter lights, you can easily view the traffic and condition of the road a long way ahead. It reduces the possibility of accidents.</p>\r\n<p>The body of CG 125 houses a more powerful 12-volt battery (instead of 6-volt). It makes the headlight and the indicators brighter. The photons of light travel for a long distance ahead. Resultantly, a long stretch of the road ahead becomes visible and clear to you. Meanwhile, the more powerful battery makes the starting-up of the engine easier and quicker.</p>\r\n<h2>Honda CG 125 2017 Price in Pakistan:</h2>\r\n								<p>The Honda CG 125 price is Pakistan is a bit over 100,000. This may seem to be high and unacceptable. But, you can satisfy your sense of judgement from the fact that, against this price, it offers you a lot more than the rival brand with similar price tag do. The 125 cc 4-stroke engine generates a thrust of 14 HP. The fuel consumption is incredibly low.</p>\r\n								<p>The bold stature, excellent performance, great speed and high resale value all serve to justify the bike’s price. If your pocket allows to own it, there is no logic in delaying the purchase.</p>\r\n</div>', 'Honda CG 125 New Model 2017 Price in Pakistan - See Pictures', '', 'publish', 'open', 'open', '', 'honda-cg-125-2017', '', '', '2018-04-19 08:11:16', '2018-04-19 08:11:16', '', 0, 'http://bike.qeemat.com/?p=305', 0, 'post', '', 0),
